(2, 'JU resursni centar za školovanje i rehabilitaciju lica sa poremećajima sluha i govora \"Dr Peruta Ivanović\" - Kotor\r\n', '42.419192;18.768138'),
(3, 'JU resursni centar za djecu i mlade \"Podgorica\"\r\n', '42.426807;19.244504');
INSERT INTO `ciljevi` (`ID`, `naziv`) VALUES
(1, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Analizira, planira i organizuje rad na realizaciji muzičkog programa, u arhivu muzičke građe i obavljanju poslova u notografiji\r\n•	Pripremi potrebne uređaje, sredstva za rad i materijale za realizaciju radnih zadatka saradnika u muzičkom programu, arhivara muzičke građe i notografa\r\n•	Koordinira aktivnosti između urednika programa, arhiva muzičke građe, tehničke i organizacione podrške u cilju realizacije muzičkog programa\r\n•	Kreira muzički program izborom odgovarajuće muzičke građe i izradom košuljice za realizaciju muzičkog programa\r\n•	Kontroliše emitovane sadržaje muzičkog programa u skladu sa muzičkom košuljicom\r\n•	Konvertuje muzičku građu u digitalne formate koristeći odgovarajuće programe\r\n•	Pripremi promotivni materijal za najavu muzičkih programa, prikupljajući potrebne podatke za promociju i najavu muzičkog programa i učestvovanjem u sastavljanju najave\r\n•	Kontroliše ispravnost muzičke građe, vršeći uvid u fizičko stanje izdate i vraćene muzičke građe\r\n•	Pripremi muzičku građu za arhiviranje, soritirajući je prema kategorijama, u skladu sa odgovarajućim procedurama\r\n•	Arhivira muzičku građu po kategorijama, u skladu sa odgovarajućom procedurom\r\n•	Pripremi i spakuje i distribuira muzičku građu\r\n•	Kreira digitalne formate muzičkog zapisa\r\n•	Izvrši konvertovanje i eksportovanje notografskog zapisa koristeći odgovarajući program\r\n•	Izvrši distribuciju različitih formata notografskog zapisa, putem interneta i medijuma za prenos\r\n•	Izvrši pripremu elemenata ponude za naplatu usluga\r\n•	Vodi poslovnu dokumentaciju iz domena rada saradnika u muzičkom programu, arhivara muzičke građe i notografa\r\n•	Pripremi elemente ponude i naplatu usluga\r\n•	Obavi poslove primjenjujući normative, standarde i procedure u redakciji muzičkog programa, arhivu muzičke građe i poslova u notografiji\r\n•	Obavi poslove sa ciljem održavanja funkcionalnosti sredstava i uređaja za rad\r\n•	Komunicira sa saradnicima i poslovnim partnerima, u skladu sa pravilima poslovne komunikacije\r\n•	Primijeni postupke i mjere zaštite na radu, zdravlja i radne i životne sredine, u skladu sa propisima'),
(2, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Analizira, planira i organizuje svoj rad i rad manjeg muzičkog ansabla za realizaciju javnog nastupa\r\n•	Obezbijedi potrebna sredstva i podršku za realizaciju javnog nastupa u skladu sa analizom\r\n•	Pripremi mjesto za javni nastup, vršeći ispunjenost zahtjeva za realizaciju u skladu sa listom zahtjeva\r\n•	Naštimuje instrument, raspjeva se, usvira se i izvodi pripremne vježbe pred javni nastup\r\n•	Izvede tonsku/ akustičku probu uz usklađivanje dinamike i načina izvođenja sa akustičnošću prostora i podešavanjem balansa među članovima ansambla\r\n•	Izvede muzički repertoar, u skladu sa uslovima javnog nastupa\r\n•	Obavi završne poslove nakon javnog nastupa, pravilnim odlaganjem instrumenta, opreme ili kostima i notnog materijala\r\n•	Ugovori javni nastup, pregovarajući o uslovima i cijeni javnog nastupa\r\n•	Vodi poslovnu dokumentaciju o javnim nastupima na odgovarajući način\r\n•	Rukovodi radom manjeg muzičkog ansambla\r\n•	Izvrši nadzor realizacije preuzetih obaveza članova manjeg muzičkog ansambla po kvalitetu i dinamici\r\n•	Sprovede lične i aktvinosti ansambla, u skladu sa primjerima dobre prakse i normativima izvođenja muzičkih djela\r\n•	Održava funkcionalnost instrumenta i opreme za javni nastup, u skladu sa uputstvima proizvođača\r\n•	Obavi komunikaciju sa saradnicima, publikom i medijma, u skladu sa pravilima poslovne komunikacije\r\n•	Primijeni postupke i mjere zaštite na radu, zdravlja, radne i životne sredine, u skladu sa propisima\r\n'),
(3, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n\r\n•	Planira i organizuje sopstveni rad za realizaciju poslova izvođenja i održavanja električnih instalacija u građevinskim objektima\r\n•	Pripremi resurse i radno mjesto za realizaciju poslova izvođenja i održavanja električnih instalacija u građevinskim objektima\r\n•	Izvede električne instalacije u građevinskim objektima, koristeći tehničku dokumentaciju\r\n•	Izradi razvodne table i ormare u građevinskim objektima i priključi ih na distributivnu mrežu\r\n\r\n•	Održava električne instalacije i uređaje u građevinskim objektima, koristeći tehničku dokumentaciju\r\n•	Izradi specifikaciju materijala i opreme potrebnih za realizaciju radnog zadatka\r\n•	Izradi radnu dokumentaciju prema propisanoj proceduri\r\n•	Sprovede postupke za kontrolu kvaliteta i kvantiteta rada, u skladu sa normativima i drugim propisima\r\n•	Održava alat, opremu i uređaje za rad\r\n•	Komunicira sa nadređenima, saradnicima i korisnicima usluga koristeći pravila poslovne komunikacije\r\n•	Sprovede postupke i mjere za zaštitu na radu, zaštitu okoline i očuvanje zdravlja\r\n\r\n'),
(4, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n\r\n•	Analizira radni zadatak, planira realizaciju i organizuje sopstveni rad i rad grupe za izvođenje poslova u elektroenergetici (elektroenergetski sistemi, elektromotorni pogoni i električne instalacije)\r\n•	Obezbijedi resurse i pripremi radno mjesto za izvođenje poslova u elektroenergetici (elektroenergetski sistemi, elektromotorni pogoni i električne instalacije)\r\n•	Izradi elemente projekata električnih mreža i električnih instalacija građevinskih objekata, pod nadzorom odgovornog projektanta\r\n•	Montira, demontira i održava elektroenergetsku opremu i uređaje u objektima elektroenergetskog sistema\r\n•	Rukuje električnim komandama za uključivanje i isključivanje električnih mašina, elektroenergetskih vodova i uređaja u objektima elektroenergetskog sistema\r\n•	Prati funkcionisanja elektroenergetskog sistema\r\n•	Montira, demontira i održava elektroopremu i uređaje elektromotornih pogona\r\n•	Podesi parametre i rukuje komandama za upravljanje elektromotornim pogonima\r\n•	Izvede i održava električne instalacije u građevinskim objektima\r\n•	Izradi razvodne table i ormare u građevinskim objektima i priključi ih na distributivnu mrežu\r\n•	Izvede specijalne električne instalacije (inteligentne električne instalacije – EIB, instalacije javne rasvjete, instalacije slabe struje)\r\n•	Koristi stručnu terminologiju i tehničku dokumentaciju na engleskom jeziku\r\n•	Izvrši kalkulaciju troškova za realizaciju radnog zadatka\r\n•	Izradi radnu dokumentaciju prema propisanoj proceduri\r\n•	Rukovodi radnom grupom za realizaciju radnog zadatka i izvrši nadzor nad poslovima koje grupa izvodi\r\n•	Sprovede postupke za kontrolu kvaliteta i kvantiteta rada, u skladu sa normativima i drugim propisima\r\n•	Održava alat, opremu i uređaje za rad\r\n•	Komunicira sa nadređenima, saradnicima i korisnicima usluga koristeći pravila poslovne komunikacije\r\n•	Sprovede postupke i mjere za zaštitu na radu, zaštitu okoline i očuvanje zdravlja\r\n\r\n\r\n'),
(5, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	-Analizira radni zadatak, planira realizaciju i organizuje sopstveni rad i rad grupe za izvođenje poslova instaliranja i održavanja računarskih sistema i mreža\r\n•	Obezbijedi resurse i pripremi radno mjesto za izvođenje poslova instaliranja i održavanja računarskih sistema i mreža\r\n•	Izradi elemente projekata računarskih mreža u stambenim, poslovnim i industrijskim objektima\r\n•	-Izvrši postavljanje i povezivanje elemenata računarskih mreža u stambenim, poslovnim i industrijskim objektima\r\n•	Izvrši konfigurisanje i povezivanje računarske mreže\r\n•	Izvrši povezivanje i testiranje pravilnog rada hardverskih komponenti računara\r\n•	-Izvrši instaliranje, konfigurisanje i ažuriranje operativnih sistema na računarima, tabletima i pametnim telefonima\r\n•	Instalira drajvere ulazno-izlaznih uređaja računara\r\n•	-Izvrši instaliranje, ažuriranje i deinstaliranje aplikativnog softvera na računarima, tabletima i pametnim telefonima\r\n•	Sprovede postupke za otklanjanje tipičnih kvarova računarskih sistema i mreža\r\n•	Upravlja rezervnim kopijama i elektronskom arhivom podataka\r\n•	Predloži optimalan računarski sistem korisnicima\r\n•	Pruži softversku podršku korisnicima\r\n•	Koristi stručnu terminologiju i tehničku dokumentaciju na engleskom jeziku\r\n•	Izvrši procjenu troškova i nabavku materijala, opreme i uređaja potrebnih za realizaciju radnog zadatka\r\n•	Izradi radnu dokumentaciju prema propisanoj procedure\r\n•	Rukovodi radnom grupom za realizaciju radnog zadatka i izvrši nadzor nad poslovima koje grupa izvodi\r\n•	Sprovede postupke za kontrolu kvaliteta i kvantiteta rada, u skladu sa normativima i drugim propisima\r\n•	Održava alat, opremu i uređaje za rad\r\n•	Komunicira sa nadređenima, saradnicima i korisnicima usluga koristeći pravila poslovne komunikacije\r\n•	Sprovede postupke i mjere za zaštitu na radu, zaštitu okoline i očuvanje zdravlja\r\n\r\n'),
(6, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	-Analizira radni zadatak, planira realizaciju i organizuje sopstveni rad i rad grupe za izvođenje poslova izgradnje, instaliranja i održavanja elektronskih komunikacionih sistema\r\n•	-Obezbijedi resurse i pripremi radno mjesto za izvođenje poslova izgradnje, instaliranja i održavanja elektronskih komunikacionih sistema\r\n•	Izradi elemente projekata telekomunikacionih korisničkih sistema, pod nadzorom odgovornog projektanta\r\n•	Instalira i konfiguriše mrežnu opremu komutacionih i data centara\r\n•	Primijeni postupke održavanja i nadzora komutacionih i data centara\r\n•	Instalira i konfiguriše telekomunikacione korisničke sisteme\r\n•	Sprovede postupke održavanja i nadzora telekomunikacionih korisničkih sistema\r\n•	Izvrši izgradnju infrastrukture telekomunikacionih prenosno-pristupnih mreža\r\n•	-Instalira i konfiguriše mrežnu opremu telekomunikacionih prenosno-pristupnih mreža, pod nadzorom nadređenog\r\n•	Primijeni postupke održavanja i nadzora telekomunikacionih prenosno-pristupnih mreža\r\n•	Koristi stručnu terminologiju i tehničku dokumentaciju na engleskom jeziku\r\n•	-Izvrši procjenu troškova i nabavku materijala, opreme, uređaja i rezervnih djelova potrebnih za realizaciju radnog zadatka\r\n•	Izradi radnu dokumentaciju prema propisanoj procedure\r\n•	Rukovodi radnom grupom za realizaciju radnog zadatka i izvrši nadzor nad poslovima koje grupa izvodi\r\n•	Sprovede postupke za kontrolu kvaliteta rada, u skladu sa normativima i drugim propisima\r\n•	Održava alat, opremu i uređaje za rad\r\n•	Komunicira sa nadređenima, saradnicima i korisnicima usluga koristeći pravila poslovne komunikacije\r\n•	Sprovede postupke i mjere za zaštitu na radu, zaštitu okoline i očuvanje zdravlja\r\n'),
(7, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	-Planira i organizuje sopstveni rad za izvođenje poslova izgradnje i održavanja elektronske komunikacione infrastrukture\r\n•	-Pripremi resurse i radno mjesto za izvođenje poslova izgradnje i održavanja elektronske komunikacione infrastructure\r\n•	Izvede pripremne i pomoćne radove za izgradnju elektronske komunikacione infrastrukture\r\n•	-Izvrši izgradnju i instaliranje kablovske infrastrukture telekomunikacionih prenosno-pristupnih mreža i telekomunikacionih korisničkih sistema\r\n•	Izvrši izgradnju bežičnih telekomunikacionih prenosno-pristupnih mreža\r\n•	Izvrši instaliranje opreme telekomunikacionih korisničkih sistema\r\n•	Održava telekomunikacione prenosno-pristupne mreže i telekomunikacione korisničke sisteme\r\n•	Obavi nabavku materijala, opreme i uređaja potrebnih za realizaciju radnog zadatka\r\n•	Izradi radnu dokumentaciju prema propisanoj procedure\r\n•	Izvrši nadzor nad aktivnostima pomoćnika tokom realizacije radnog zadatka\r\n•	Sprovede postupke za kontrolu kvaliteta rada, u skladu sa normativima i drugim propisima\r\n•	Održava alat, opremu i uređaje za rad\r\n•	Komunicira sa nadređenima, saradnicima i korisnicima usluga, koristeći pravila poslovne komunikacije\r\n•	Sprovede postupke i mjere za zaštitu na radu, zaštitu okoline i očuvanje zdravlja'),
(8, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	-Analizira radni zadatak, planira realizaciju i organizuje sopstveni rad i rad grupe za izvođenje poslova proizvodnje, instaliranja i održavanja elektronskih uređaja i sistema i sistema industrijske elektronike i automatike\r\n•	-Obezbijedi resurse i pripremi radno mjesto za izvođenje poslova proizvodnje, instaliranja i održavanja elektronskih uređaja i sistema i sistema industrijske elektronike i automatike\r\n•	-Izradi elemente projekata elektronskih sigurnosnih sistema i sistema industrijske elektronike i automatike, pod nadzorom odgovornog projektanta\r\n•	Izvrši dizajniranje i izradu elektronskih štampanih ploča\r\n•	Izvrši programiranje i testiranje proizvedenih elektronskih uređaja i sistema\r\n•	-Instalira elektronske sigurnosne sisteme, sisteme industrijske elektronike i automatike, elektronske komercijalne uređaje i sisteme i proizvedene elektronske uređaje i sisteme\r\n•	Izvrši nadogradnju hardvera i softvera elektronskih komercijalnih uređaja i sistema\r\n•	-Izvrši funkcionalno ispitivanje i konfigurisanje elektronskih sigurnosnih sistema, sistema industrijske elektronike i automatike i elektronskih komercijalnih uređaja i sistema\r\n•	Izradi razvodne i komandne table, ormare i pultove sistema industrijske elektronike i automatike\r\n•	-Sprovede postupke održavanja elektronskih sigurnosnih sistema, sistema industrijske elektronike i automatike, elektronskih komercijalnih uređaja i sistema i proizvedenih elektronskih uređaja i sistema\r\n•	Koristi stručnu terminologiju i tehničku dokumentaciju na engleskom jeziku\r\n•	-Izvrši procjenu troškova i nabavku materijala, opreme, uređaja i rezervnih djelova potrebnih za realizaciju radnog zadatka\r\n•	Izradi radnu dokumentaciju prema propisanoj procedure\r\n•	Rukovodi radnom grupom za realizaciju radnog zadatka i izvrši nadzor nad poslovima koje grupa izvodi\r\n•	Sprovede postupke za kontrolu kvaliteta i kvantiteta rada, u skladu sa normativima i drugim propisima\r\n•	Održava alat, opremu i uređaje za rad\r\n•	Komunicira sa nadređenima, saradnicima i korisnicima usluga koristeći pravila poslovne komunikacije\r\n•	Sprovede postupke i mjere za zaštitu na radu, zaštitu okoline i očuvanje zdravlja\r\n'),
(9, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	-Analizira radni zadatak, planira njegovu realizaciju i organizuje sopstveni rad i rad grupe za izvođenje poslova montiranja, demontiranja, puštanja u rad i održavanja mehatroničkih uređaja i sistema\r\n•	-Obezbijedi resurse za izvođenje poslova montiranja, demontiranja, puštanja u rad i održavanja mehatroničkih uređaja i sistema\r\n•	Montira, demontira i funkcionalno povezuje djelove mehatroničkih uređaja i sistema\r\n•	Instalira upravljački hardver, softver i prateće programe mehatroničkih uređaja i sistema\r\n•	Podesi mehatroničke uređaje i sisteme\r\n•	Ispita funkcionalnost mehatroničkih djelova, uređaja i sistema\r\n•	Primijeni postupke preventivnog i korektivnog održavanja mehatroničkih uređaja i sistema\r\n•	Izradi djelove projekta mehatroničkih uređaja i sistema\r\n•	Izvrši kalkulaciju troškova realizacije radnog zadatka\r\n•	Popuni radnu dokumentaciju prema propisanoj procedure\r\n•	Rukovodi radnom grupom za realizaciju radnog zadatka\r\n•	Izvrši nadzor nad poslovima za realizaciju radnog zadatka\r\n•	Sprovede postupke za kontrolu kvaliteta i kvantiteta rada, u skladu sa normativima i drugim propisima\r\n•	Održava alat, opremu i uređaje za rad\r\n•	Komunicira sa nadređenima, saradnicima i korisnicima usluga koristeći pravila poslovne komunikacije\r\n•	Sprovede postupke i mjere za zaštitu na radu, zaštitu životne sredine i očuvanje zdravlja'),
(10, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Planira i organizuje sopstveni rad za realizaciju poslova izvođenja građevinskih radova\r\n•	Pripremi resurse i radno mjesto za realizaciju poslova izvođenja građevinskih radova\r\n•	Zida elemente objekta zidarskim blokovima i kamenom\r\n•	Malteriše unutrašnje i spoljašnje površine objekta\r\n•	Izrađuje cementne podloge i slojeve za pad na elementima objekta\r\n•	Vrši ugradnju prefabrikovanih elemenata u niskogradnji\r\n•	Obradi armaturu u skladu sa specifikacijom materijala\r\n•	Ugradi obrađenu armaturu i kablove za prethodno naprezanje u konstruktivni element\r\n•	Izradi drvenu oplatu za betonske i armirano-betonske elemente\r\n•	Izvrši montažu i demontažu oplate od modularnih elemenata\r\n•	Izradi građevinske skele, radne staze i platforme sa zaštitnim ogradama\r\n•	Izradi drvene konstrukcije\r\n•	Izradi hidroizolaciju na pozicijama predviđenim projektom\r\n•	Ugradi termoizolaciju na pozicijama predviđenim projektom\r\n•	Ugradi zvučnu izolaciju na pozicijama predviđenim projektom\r\n•	Izvede zemljane radove\r\n•	Izvrši spravljanje i ugradnju betona u pozicije predviđene projektom\r\n•	Izradi radnu dokumentaciju prema propisanoj proceduri\r\n•	Obavlja nabavku materijala i opreme potrebne za realizaciju radnog zadatka\r\n•	Sprovede postupke za kontrolu kvaliteta i kvantiteta rada, u skladu sa normativima i drugim propisima\r\n•	Održava alat, opremu i uređaje koje koristi za rad\r\n•	Komunicira sa nadređenima, saradnicima i korisnicima usluga koristeći pravila poslovne komunikacije\r\n•	Sprovede postupke i mjere za zaštitu na radu, zaštitu okoline i očuvanje zdravlja\r\n'),
(11, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Izvede pripremne radove za montažu vodovodnih i kanalizacionih instalacija\r\n•	Izvrši montažu vodovodnih i kanalizacionih instalacija\r\n•	Izvrši ispitivanje vodovodne i kanalizacione mreže\r\n•	Izvrši montažu sanitarnih uređaja i galanterije\r\n•	Izvrši rekonstrukciju vodovodne i kanalizacione mreže\r\n•	Izvrši popravke i održavanje vodovodne i kanalizacione mreže\r\n•	Konstruktivno komunicira sa neposrednim saradnicima, nadređenima, sa strankama (naručiocima posla) i dobavljačima materijala na maternjem i jednom stranom jeziku\r\n•	Primijeni propise zaštite na radu, kao i mjere zaštite i očuvanja životne sredine'),
(12, 'Po završetku obrazovnog programa, učenik će biti sposoban da:\r\n•	-Analizira radni zadatak, planira realizaciju i organizuje sopstveni rad i rad grupe za izvođenje poslova projektovanja i izvođenja objekata niskogradnje i hidrogradnje\r\n•	Obezbijedi resurse i pripremi radno mjesto za izvođenje poslova projektovanja i izvođenja objekata niskogradnje i hidrogradnje\r\n•	Izradi djelove glavnog projekta za potrebe izvođenja objekta niskogradnje i hidrogradnje\r\n•	Organizuje gradilište objekta niskogradnje i hidrogradnje\r\n•	Organizuje izvođenje radova na donjem i gornjem stroju saobraćajnice\r\n•	Organizuje izvođenje radova izgradnje i održavanja na gornjem stroju željezničke pruge\r\n•	Organizuje izvođenje radova na ugradnji opreme saobraćajnice\r\n•	Organizuje izgradnju objekata na saobraćajnici\r\n•	Izradi djelove projekta organizacije i tehnologije građenja\r\n•	Izvrši razradu djelova glavnog projekta za potrebe izvođenja objekta hidrogradnje\r\n•	Organizuje izvođenje instalacija vodovodne i kanalizacione mreže\r\n•	Izvrši kontrolu kvaliteta materijala, opreme i izvođenja radova\r\n•	Koristi stručnu terminologiju i tehničku dokumentaciju na engleskom jeziku\r\n•	-Izvrši procjenu troškova i nabavku materijala, opreme, uređaja i rezervnih djelova potrebnih za realizaciju radnog zadatka\r\n•	Izradi radnu dokumentaciju prema propisanoj procedure\r\n•	Rukovodi radnom grupom za realizaciju radnog zadatka i izvrši nadzor nad poslovima koje grupa izvodi\r\n•	Sprovede postupke za kontrolu kvaliteta rada, u skladu sa normativima i drugim propisima\r\n•	Održava alat, opremu i uređaje za rad\r\n•	Komunicira sa nadređenima, saradnicima i korisnicima usluga koristeći pravila poslovne komunikacije\r\n•	Sprovede postupke i mjere za zaštitu na radu, zaštitu okoline i očuvanje zdravlja\r\n'),
(13, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	-Analizira radni zadatak, planira realizaciju i organizuje sopstveni rad i rad grupe za izvođenje poslova projektovanja i izvođenja objekata visokogradnje\r\n•	-Obezbijedi resurse i pripremi radno mjesto za izvođenje poslova projektovanja i izvođenja objekata visokogradnje\r\n•	Izradi djelove idejnog i glavnog projekta konstrukcije objekata visokogradnje\r\n•	Izradi djelove projekta organizacije i tehnologije građenja\r\n•	-Izvrši razradu djelova projektne dokumentacije objekata visokogradnje za potrebe izvođenja građevinskih radova\r\n•	Organizuje gradilište i izvođenje radova na gradilištu objekta visokogradnje\r\n•	Izradi metodologiju za izvođenje radova\r\n•	Prati izradu montažnih konstrukcija u radioničkim pogonima\r\n•	Izvrši kontrolu kvaliteta procesa izvođenja radova na gradilištu i sprovede proceduru otklanjanja nedostataka tokom izvođenja radova\r\n•	Izvrši ispitivanje materijala u laboratoriji i na gradilištu\r\n•	Učestvuje u ispitivanju konstrukcija izvedenih objekata\r\n•	Učestvuje u procjeni vrijednosti nektrtnine\r\n•	Koristi stručnu terminologiju i tehničku dokumentaciju na engleskom jeziku\r\n•	-Izvrši procjenu troškova i nabavku materijala, opreme, uređaja i rezervnih djelova potrebnih za realizaciju radnog zadatka\r\n•	Izradi radnu dokumentaciju prema propisanoj procedure\r\n•	Rukovodi radnom grupom za realizaciju radnog zadatka i izvrši nadzor nad poslovima koje grupa izvodi\r\n•	Sprovede postupke za kontrolu kvaliteta rada, u skladu sa normativima i drugim propisima\r\n•	Održava alat, opremu i uređaje koje koristi za rad\r\n•	Komunicira sa nadređenima, saradnicima i korisnicima usluga koristeći pravila poslovne komunikacije\r\n•	Sprovede postupke i mjere za zaštitu na radu, zaštitu okoline i očuvanje zdravlja\r\n'),
(15, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Obavi poslove platnog prometa i evidentiranja bezgotovinskog i gotovinskog (blagajničkog) plaćanja\r\n•	Obavi knjigovodstvene poslove analitike kupaca i dobavljača\r\n•	Vodi robno i materijalno knjigovodstvo i evidencije na pozicijama -kontima uspjeha (rashodi, prihodi i finansijski rezultat)\r\n•	Vodi evidencije obrtnih sredstava u propisanom knjigovodstvu, gotovine, gotovinskih ekvivalenata i hartija od vrijednosti\r\n•	Vodi evidencije poreza na dodatu vrijednost, poreza na dobit i poreza po odbitku\r\n•	Vodi knjigovodstvo stalne i nematerijalne imovine\r\n•	Vodi evidenciju kapitala, rezervi i neraspoređene dobiti, troškova materijala, troškova zarada, amortizacije, nematerijalnih troškova, troškova proizvodnih usluga, finansijskih i ostalih rashoda, poslovnih, finansijskih i ostalih prihoda\r\n•	Vodi evidencije proizvodnje, obračun troškova i učinaka\r\n•	Vodi evidencije poslovanja trgovinskog poslovnog subjekta u unutrašnjem i spoljnotrgovinskom prometu\r\n•	Vodi knjigovodstvo budžetskih korisnika, banaka, osiguravajućih organizacija i neprofitnih organizacija\r\n•	Obavlja poslove kreditiranja i kontrole kreditnih zahtjeva, u skladu sa propisanom procedurom\r\n•	Sprovede postupak otvaranja transakcionih računa za izvršavanje nacionalnih i međunarodnih platnih transakcija, u skladu sa važećim propisima i procedurama\r\n•	Obavi poslove sa depozitima fizičkih i pravnih lica, u skladu sa važećim propisima\r\n•	Obavi poslove sa gotovinom, u skladu sa djelokrugom svog rada\r\n•	Obavi poslove nacionalnog i međunarodnog platnog prometa, u skladu sa važećim propisima\r\n•	Obavi poslove bezgotovinskog plaćanja, u skladu sa važećim propisima\r\n•	Obavi osnovne finansijske poslove za poslovnog subjekta\r\n•	Upravlja budžetskim procesom poslovnog subjekta\r\n•	Upravlja finansijskim rizicima u poslovanju poslovnog subjekta\r\n•	Upravlja gotovim novcem u cilju obezbjeđenja normalnog funkcionisanja poslovnog subjekta\r\n•	Posluje sa hartijama od vrijednosti u cilju ostvarivanja prihoda poslovnog subjekta\r\n•	Sprovede postupak osiguranja lica prilikom putovanja i privremenog boravka u inostranstvu, u skladu sa propisanim uslovima i tarifama za osiguranje\r\n•	Sprovede postupak osiguranja lica od posljedica nesrećnog slučaja, u skladu sa propisanim uslovima i tarifama za osiguranje\r\n•	Sprovede postupak osiguranja motornih vozila, u skladu sa kategorijom vozila i propisanim pravilima za utvrđivanje vrijednosti vozila\r\n•	Sprovede postupak osiguranja imovine fizičkih i pravnih lica\r\n•	Sprovede postupak osiguranja transporta (CMR i KARGO) u domaćem i međunarodnom prevozu\r\n•	Sprovede postupak obrade zahtjeva i dokumentacije za naknadu štete, likvidacije i isplate štete\r\n•	Komunicira sa kolegama, strankama i drugim licima na maternjem, odnosno službenom i stranom jeziku, u skladu sa pravilima poslovne komunikacije\r\n•	Vodi administrativne i komercijalne poslove iz djelokruga svog rada\r\n•	Koristi informacione i telekomunikacione tehnologije u radu\r\n•	Primijeni postupke i mjere zaštite na radu, zdravlja i radne i životne sredine, u skladu sa propisima\r\n'),
(16, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Elektronski uređuje i oblikuje tekst i tabele koristeći računar i program za obradu teksta i tabela\r\n•	Koristi tehnička sredstva i kancelarijski pribor za pripremu tekstualnih materijala\r\n•	Obavi poslove prijema, otpremanja, evidentiranja i arhiviranja pošte i dokumenata, u skladu sa pravilima o kancelarijskom poslovanju\r\n•	Upiše podatke i vodi matične registre i evidencije, u skladu sa važećim propisima\r\n•	Obavi poslove ovjeravanja i izdavanja dokumenata i javnih isprava, u skladu sa važećim propisima\r\n•	Izradi nacrte određenih pravnih akata u odgovarajućoj formi\r\n•	Vodi poslovnu i službenu korespondenciju u okviru svog djelokruga rada, u skladu sa pravilima službene i poslovne korespondencije\r\n•	Organizuje prijem i pruža informacije strankama, u skladu sa radnim protokolom organizacije\r\n•	Planira, priprema i organizuje razne vrste sastanaka i sastavi izvještaj o održanom sastanku\r\n•	Organizuje službena putovanja za nadređene i druge zaposlene\r\n•	Obavi usmenu i pisanu komunikaciju sa kolegama, strankama i drugim licima na maternjem, odnosno službenom i stranom jeziku, u skladu sa pravilima poslovne komunikacije\r\n•	Vodi administrativne i komercijalne poslove iz djelokruga svog rada\r\n•	Koristi informacione i telekomunikacione tehnologije u radu\r\n•	Primijeni postupke i mjere zaštite na radu, zdravlja i radne i životne sredine, u skladu sa propisima\r\n'),
(17, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Analizira, planira i organizuje sopstveni rad i rad radne grupe u skladu sa dnevnim i nedjeljnim zaduženjim\r\n•	Pripremi uslove i radno mjesto za proces proizvodnje, u skladu sa planom proizvodnje hljeba, peciva i zahtjevnih pekarskih proizvoda\r\n•	Pripremi sirovine i vodu za proces proizvodnje hljeba, peciva i zahtjevnih pekarskih proizvoda\r\n•	Obavi zamjesivanje i obradu tijesta za proizvodnju hljeba, peciva i zahtjevnih pekarskih proizvoda\r\n•	Obavi postupke fermentacije i termičke obrade tijesta za proizvodnju hljeba, peciva i zahtjevnih pekarskih proizvoda\r\n•	Kontroliše kvalitet sirovina, hljeba, peciva i zahtjevnih pekarskih proizvoda\r\n•	Održava optimalne higijenske uslove u pekarskoj proizvodnji\r\n•	Izračuna utrošak sirovina, materijala i vremena za realizaciju radnih zadataka u skladu sa specifikacijom za izradu hljeba, peciva i zahtjevnih pekarskih proizvoda\r\n•	Vodi radnu dokumentaciju u proizvodnji hljeba, peciva i zahtjevnih pekarskih proizvoda u pisanoj i elektronskoj formi\r\n•	Rukovodi i nadzire radnu grupu za realizaciju procesa proizvodnje hljeba, peciva i zahtjevnih pekarskih proizvoda\r\n•	Obezbijedi kvalitet sopstvenog rada\r\n•	Obavi osnovno održavanje opreme i sredstava za rad u proizvodnji hljeba, peciva i zahtjevnih pekarskih proizvoda\r\n•	Komunicira sa saradnicima i nadređenima u skladu sa pravilima poslovne komunikacije\r\n•	Primijeni mjere zaštite i zdravlja na radu, i zaštite životne sredine\r\n'),
(18, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Analizira, planira i organizuje sopstveni rad, u skladu sa dnevnim zaduženjima\r\n•	Pripremi osnovne resurse i radno mjesto za obavljanje poslova za proces proizvodnje prehrambenih proizvoda biljnog i animalnog porijekla\r\n•	Pripremi sirovine i vodu za proces proizvodnje prehrambenih proizvoda biljnog i animalnog porijekla\r\n•	Rukuje uređajima i mašinama u proizvodnji prehrambenih proizvoda biljnog i animalnog porijekla\r\n•	Puni, pakuje i skladišti prehrambene proizvode biljnog i animalnog porijekla\r\n•	Održava optimalne higijenske uslove u proizvodnji prehrambenih proizvoda biljnog i animalnog porijekla\r\n•	Vodi radnu dokumentaciju u pisanoj i elektronskoj formi\r\n•	Obezbijedi kvalitet sopstvenog rada u proizvodnji prehrambenih proizvoda biljnog i animalnog porijekla\r\n•	Obavi osnovno održavanje opreme i sredstava za rad, koje koristi pri obavljanju posla\r\n•	Komunicira sa saradnicima i nadređenima u proizvodnji\r\n•	Primijeni mjere zaštite i zdravlja na radu, i zaštite životne sredine'),
(19, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Analizira dnevna i nedjeljna zaduženja i planira rad u proizvodnji animalnih i biljnih prehrambenih proizvoda\r\n•	Organizuje sopstveni rad i rad radne grupe, u skladu sa dnevnim i nedjeljnim zaduženjima\r\n•	Pripremi uslove i radno mjesto za proces proizvodnje, u skladu sa planom proizvodnje prehrambenih proizvoda biljnog i animalnog porijekla\r\n•	Pripremi osnovne sirovine, pomoćne sirovine i vodu za proces proizvodnje prehrambenih proizvoda biljnog i animalnog porijekla\r\n•	Obavi tehnološke procese u proizvodnji animalnih i biljnih prehrambenih proizvoda, u skladu sa odgovarajućom vrstom tehnologije\r\n•	Puni i pakuje prehrambene proizvode biljnog i animalnog porijekla\r\n•	Kontroliše kvalitet tokom tehnološkog procesa proizvodnje prehrambenih proizvoda biljnog i animalnog porijekla\r\n•	Kontroliše održavanje higijenskih uslova u proizvodnji prehrambenih proizvoda biljnog i animalnog porijekla\r\n•	Izračuna utrošak sirovina, materijala i vremena za realizaciju radnih zadataka, u skladu sa dobijenom recepturom i specifikacijom\r\n•	Vodi radnu dokumentaciju u tehnologiji proizvodnje prehrambenih proizvoda biljnog i animalnog porijekla u pisanoj i elektronskoj formi\r\n•	Rukovodi i nadzire radnu grupu za realizaciju procesa proizvodnje prehrambenih proizvoda biljnog i animalnog porijekla\r\n•	Obavi poslove u skladu sa normativima i standardima struke\r\n•	Održava alat, opremu, uređaje i mašine za rad, koje koristi pri obavljanju posla\r\n•	Komunicira sa saradnicima i nadređenima u proizvodnji prehrambenih proizvoda biljnog i animalnog porijekla\r\n•	Primijeni mjere zaštite i zdravlja na radu i zaštite životne sredine\r\n'),
(20, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Analizira, planira i organizuje rad u u cilju njege, zdravstvene zaštite i liječenja životinja\r\n•	Pripremi radno mjesto za realizaciju poslova u skladu sa planiranim aktivnostima i radnim zadatkom\r\n•	Obavi prijem i smještaja životinja u uzgojno proizvodne prostore ili veterinarsku ambulantu\r\n•	Identifikuje bolesne životinje i sprovodi njihovo liječenje\r\n•	Sprovodi program zdravstvene zaštite životinja\r\n•	Manipuliše sa različitim vrstama biološkog materijala u procesu očuvanja zdravlja životinja\r\n•	Obavi poslove u reprodukciji u cilju inseminacije i očuvanja reproduktivnog zdravlja životinja\r\n•	Asistira u sprovođenju hirurških zahvata kod životinja\r\n•	Učestvuje u pružanju prve pomoći kod bolesnih životinja\r\n•	Sprovede postupak pravilnog uzgoja i ishrane životinja u cilju očuvanja zdravlja životinja\r\n•	Vodi dokumentaciju pri obavljanju poslova njege, zdravstvene zaštite i liječenja životinja\r\n•	Obezbijedi kvalitet sopstvenog rada\r\n•	Obavi osnovno održavanje opreme, instrumenata i uređaja za rad\r\n•	Komunikacira sa saradnicima i vlasnicima životinja, u skladu sa pravilima poslovne komunikacije\r\n•	Primijeni mjere zaštite i zdravlja na radu, i zaštite životne sredine'),
(21, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Planira aktivnosti i organizuje sopstveni rad za sprovođenje kozmetičkih procedura\r\n•	Pripremi radno mjesto i resurse i izvrši ličnu pripremu za sprovođenje kozmetičkih procedura\r\n•	Izvrši prijem klijenata u kozmetičkom salonu u skladu sa pravilima poslovne komunikacije i bontona\r\n•	Izvede proceduru depilacije, različitim metodama\r\n•	Izvede proceduru pilinga i pakovanja za njegu tijela\r\n•	Izvrši obradu zanoktica i nokatnih ploča prilikom izvođenja manikir procedure, na noktima koji ne zahtijevaju dermatološki pregled\r\n•	Izvrši obradu zanoktica, kože na stopalima i nokatnih ploča prilikom izvođenja pedikir procedure, na noktima koji ne zahtijevaju dermatološki pregled\r\n•	Izvrši dekoraciju nokatnih ploča na prstima šaka i stopala, različitim tehnikama\r\n•	Izvede tretmane za njegu ruku i stopala\r\n•	Izvede procedure dnevne i večernje šminke\r\n•	Izvede procedure šminke za vjenčanja, televizijske i fotografske šminke\r\n•	Obavi završne poslove u kozmetičkom salonu\r\n•	Izvrši nabavku opreme, aparata i repromaterijala potrebnih za izvođenje kozmetičkih procedura\r\n•	Izvrši naplatu i promociju kozmetičkih usluga\r\n•	Vodi radnu dokumentaciju prema propisanoj proceduri\r\n•	Sprovede postupke za kontrolu kvaliteta rada prilikom izvođenja kozmetičkih procedura\r\n•	Izvrši osnovno održavanje aparata, opreme i pribora za rad u kozmetičkom salonu\r\n•	Komunicira sa saradnicima, poslovnim partnerima i klijentima, u skladu sa pravilima poslovne komunikacije\r\n•	Sprovede postupke i mjere za zaštitu na radu, zaštitu okoline i očuvanje zdravlja\r\n\r\n'),
(22, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Analizira i planira aktivnosti, organizuje sopstveni rad i rad osoblja za sprovođenje kozmetičkih procedura\r\n•	Pripremi radno mjesto, resurse i izvrši ličnu pripremu za sprovođenje kozmetičkih procedura\r\n•	Izvrši prijem klijenata u kozmetičkom salonu u skladu sa pravilima poslovne komunikacije i bontona\r\n•	Izvede proceduru depilacije, različitim metodama\r\n•	Izvede proceduru pilinga i pakovanja za njegu tijela\r\n•	Izvrši obradu zanoktica i nokatnih ploča prilikom izvođenja manikir procedure, na noktima koji ne zahtijevaju dermatološki pregled\r\n•	Izvrši obradu zanoktica, kože na stopalima i nokatnih ploča prilikom izvođenja pedikir procedure, na noktima koji ne zahtijevaju dermatološki pregled\r\n•	Izvrši dekoraciju nokatnih ploča na prstima šaka i stopala, različitim tehnikama\r\n•	Izvede tretmane za njegu ruku i stopala\r\n•	Izvrši oblikovanje obrva, farbanje obrva i trepavica\r\n•	Izvrši pregled i analizu kože lica u cilju odabira odgovarajućeg tretmanaIzvede higijenski i biološki tretman lica na koži koja ne zahtijeva dermatološki pregled\r\n•	Izvede aparaturne tretmane lica primjenom sonoterapije i aparatima za oksigenaciju, neinvazivnu mezoterapiju i jonoforezu\r\n•	Izvede kozmetoterapijsku masažu tijela\r\n•	Izvede kozmetoterapijske procedure u tretmanu celulita\r\n•	Izvede aparaturne tretmane tijela primjenom sonoterapije, termo ćebeta, aparatima za elektromišićnu stimulaciju i neinvazivnu mezoterapiju\r\n•	Izvede fototerapijske i fotoestetske procedure\r\n•	Izvede procedure dnevne i večernje šminke\r\n•	Izvede procedure šminke za vjenčanja, televizijske i fotografske šminke\r\n•	Obavi završne poslove u kozmetičkom salonu\r\n•	Koristi stručnu terminologiju na engleskom jeziku\r\n•	Izvrši nabavku opreme, aparata i repromaterijala potrebnih za izvođenje kozmetičkih procedura\r\n•	Vodi finansijsko poslovanje u kozmetičkom salonu i promoviše kozmetičke usluge\r\n•	Vodi radnu dokumentaciju prema propisanoj procedure\r\n•	Rukovodi osobljem i izvrši nadzor nad poslovima osoblja prilikom izvođenja kozmetičkih procedura\r\n•	Sprovede postupke za kontrolu kvaliteta rada prilikom izvođenja kozmetičkih procedura\r\n•	Izvrši osnovno održavanje aparata, opreme i pribora za rad u kozmetičkom salonu\r\n•	Komunicira sa saradnicima, poslovnim partnerima i klijentima, u skladu sa pravilima poslovne komunikacije\r\n•	Sprovede postupke i mjere za zaštitu na radu, zaštitu okoline i očuvanje zdravlja\r\n\r\n'),
(23, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Planira i organizuje poslove u kuhinjskom bloku\r\n•	Obavi pripremne poslove u kuhinjskom bloku\r\n•	Obradi namirnice prema radnom nalogu za pripremanje jednostavnih gastronomskih proizvoda\r\n•	Pripremi salate od povrća, zaprške, jednostavna jela od jaja, garniture od povrća i topla jela od jaja, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Pripremi fondove i sosove tople i hladne kuhinje, bistre supe i uloške za bistre supe, čorbe, potaže i jela od riba, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Pripremi jela sa roštilja od mljevenog mesa, od porcionisanog mesa, od iznutrica, od riba i morskih plodova i prateće dodatke, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Pripremi gastronomske proizvode od kisjelog, lisnatog, vučenog, krompir i linzer tijesta, pice, tortilje i burita i prateće nadjeve, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Pripremi povezane salate, hladna predjela od jaja, povrća, mesa, riba, rakova, mekušaca, zakuske, kanapee, bruskete, topla predjela od tijesta, krokete, pečurke, rižota, suflee i pudinge kao topla predjela, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Pripremi gotova jela, pečenja, jednostavna jela po porudžbini od mesa stoke za klanje i jednostavna nacionalna jela iz Crne gore, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Pripremi jednostavne poslastičarske proizvode od biskvit mase, od tijesta, hladne, tople, sitne kolače i jednostavne nacionalne poslastičarske proizvode iz Crne Gore, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Obavi rasijecanje, obradu, začinjavanje, formiranje, porcionisanje i pakovanje mesa, riba i morskih plodova, za gastronomsku upotrebu, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Servira i izdaje jednostavne gastronomske proizvode, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Obavi završne poslove u kuhinjskom bloku\r\n•	Vodi odgovarajuću poslovnu dokumentaciju u odgovarajućoj formi\r\n•	Rukovodi radom pomoćnog osoblja u kuhinjskom bloku\r\n•	Obavi poslove, u skladu sa normativima i standardima struke, osigurava kvalitet sopstvenog rada i pomoćnog osoblja\r\n•	Održava funkcionalnost uređaja, opreme i inventara, u skladu sa odgovarajućom procedurom i uputstvom\r\n•	Komunicira sa saradnicima i gostima koristeći pravila poslovne komunikacije\r\n•	Sprovodi postupke i mjere za ličnu zaštitu zdravlja na radu i zaštitu zdravlja gostiju i saradnika\r\n•	Primijeni standarde zaštite radne i životne sredine\r\n'),
(24, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Planira i organizuje poslove u kuhinjskom bloku\r\n•	Organizuje i kontroliše pripremne poslove u kuhinjskom bloku\r\n•	Obradi namirnice prema radnom nalogu za pripremanje gastronomskih proizvoda\r\n•	Pripremi salate od povrća, zaprške, jednostavna jela od jaja, garniture od povrća i topla jela od jaja, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Pripremi fondove i sosove tople i hladne kuhinje, bistre supe i uloške za bistre supe, čorbe, potaže i jela od riba, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Pripremi jela sa roštilja od mljevenog mesa, od porcionisanog mesa, od iznutrica, od riba i morskih plodova i prateće dodatke, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Pripremi gastronomske proizvode od kisjelog, lisnatog, vučenog, krompir i linzer tijesta, pice, tortilje i burita i prateće nadjeve, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Pripremi povezane salate, hladna predjela od jaja, povrća, mesa, riba, rakova, mekušaca, zakuske, kanapee, bruskete, topla predjela od tijesta, krokete, pečurke, rižota, suflee i pudinge kao topla predjela, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Pripremi, servira, dekoriše i prezentuje gotova jela, pečenja, jela po porudžbini od mesa stoke za klanje i divljači, jela bazirana na posebnom načinu ishrane, internaionalna i nacionalna jela iz Crne gore, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Pripremi, servira, dekoriše i prezentuje poslastičarske proizvode od biskvit mase, od tijesta, hladne, tople, sitne kolače, svečane torte, sladolede, sorbee i nacionalne poslastičarske proizvode iz Crne Gore, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Obavi rasijecanje, obradu, začinjavanje, formiranje, porcionisanje i pakovanje mesa, riba i morskih plodova, za gastronomsku upotrebu, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Pripremi jela pred gostom, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Sastavi pisana sredstva ponude gastronomskih proizvoda\r\n•	Utvrdi normative, sastavi recept i izvrši kontrolu kvaliteta gastronomskih proizvoda, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Servira i izdaje gastronomske proizvode, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Obavi završne poslove u kuhinjskom bloku\r\n•	Izvrši promociju gastronomske ponude i nabavku robe\r\n•	Vodi odgovarajuću poslovnu dokumentaciju u odgovarajućoj formi\r\n•	Rukovodi i nadzire rad kuvara i pomoćnog osoblja u kuhinjskom bloku\r\n•	Obavlja poslove, u skladu sa normativima i standardima struke, osigurava kvalitet sopstvenog rada, kuvara i pomoćnog osoblja\r\n•	Održava funkcionalnost uređaja, opreme i inventara, u skladu sa odgovarajućom procedurom i uputstvom\r\n•	Komunicira sa saradnicima i gostima, u skladu sa pravilima poslovne komunikacije\r\n•	Sprovode postupke i mjere za ličnu zaštitu zdravlja na radu i zaštitu zdravlja gostiju i saradnika\r\n•	Sprovede kontrolu primjene mjera propisanih HACCP standardom\r\n•	Primijeni standarde zaštite radne i životne sredine\r\n'),
(25, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Organizuje svoj rad i rad pomoćnog osoblja u ofisu, na reonu u sali za usluživanje i baru\r\n•	Obavi pripremne radove u ofisu, sali za usluživanje i baru\r\n•	Pripremi barski pult za točenje, miješanje i izdavanje pića, mješavina, napitaka i malih obroka\r\n•	Primi i isprati goste\r\n•	Primi porudžbinu za hranu, piće i napitke od konobara ili direktno od gosta\r\n•	Posluži hranu i piće gostima\r\n•	Toči, aranžira i servira alkoholna, bezalkoholna pića i napitke\r\n•	Pripremi, aranžira i servira alkoholne i bezalkoholne mješavine\r\n•	Izda račun i izvrši naplatu usluga\r\n•	Izvodi završne radove u ofisu, sali za usluživanje i baru\r\n•	Izvrši materijalno i finansijsko zaduženje i razduženje\r\n•	Vodi odgovarajuću poslovnu dokumentaciju\r\n•	Rukovodi radom pomoćnog osoblja u restoranu i baru\r\n•	Nadzire rad konobara i pomoćnog osoblja u restoranu i baru\r\n•	Obavi poslove u skladu sa normativima i standardima struke i osigurava kvalitet rada konobara i pomoćnog osoblja\r\n•	Održi funkcionalnost opreme i inventara u ofisu, sali za usluživanje i baru\r\n•	Komunicira sa saradnicima i gostima\r\n•	Štiti svoje zdravlje i zdravlje gostiju i saradnika\r\n•	Primijeni standarde zaštite radne i životne sredine\r\n'),
(26, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Organizuje svoj rad i rad pomoćnog osoblja u ofisu, na reonu u sali za usluživanje i baru\r\n•	Obavi pripremne radove u ofisu, sali za usluživanje i baru\r\n•	Pripremi barski pult za točenje, miješanje i izdavanje pića, mješavina, napitaka i malih obroka\r\n•	Primi i isprati goste\r\n•	Primi porudžbinu za hranu, piće i napitke od konobara ili direktno od gosta\r\n•	Posluži hranu i piće gostima\r\n•	Natoči, aranžira i servira alkoholna, bezalkoholna pića i napitke\r\n•	Pripremi, aranžira i servira alkoholne i bezalkoholne mješavine\r\n•	Izda račun i izvrši naplatu usluga\r\n•	Izvede završne radove u ofisu, sali za usluživanje i baru\r\n•	Materijalno se zaduži i razduži\r\n•	Vodi odgovarajuću poslovnu dokumentaciju\r\n•	Rukovodi radom pomoćnog osoblja u restoranu i baru\r\n•	Obavi poslove, u skladu sa normativima i standardima struke i osigura kvalitet rada pomoćnog osoblja\r\n•	Održi funkcionalnost opreme i inventara u ofisu, sali za usluživanje i baru\r\n•	Komunicira sa saradnicima i gostima\r\n•	Štiti svoje zdravlje i zdravlje gostiju i saradnika\r\n•	Primijeni standarde zaštite radne i životne sredine\r\n'),
(27, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Analizira, planira i organizuje sopstveni rad i rad pomoćnog prodavača pri obavljanju poslova prodaje robe\r\n•	Izvrši ličnu i pripremu potrebnih resursa i radnog mjesta za obavljanje posla\r\n•	Preuzme i pripremi robu za prodaju\r\n•	Izloži robu u prodajnom prostoru\r\n•	Usluži kupca, u skladu sa tipom i karakteristikama kupca i različitim načinima i vrstama prodajeIzda i naplati račun za kupljenu robu\r\n•	Izvrši pripremu za popis i otpis u prodajnom objektu\r\n•	Vodi poslovnu dokumentaciju, u skladu sa standardima struke\r\n•	Obavi poslove, u skladu sa standardima struke\r\n•	Izvrši osnovno održavanje uređaja i opreme za prodaju robe\r\n•	Komunicira sa kupcima, nadređenima i saradnicima, u skladu sa pravilima poslovne komunikacije\r\n•	Sprovede mjere zaštite i zdravlja na radu, i zaštite životne sredine'),
(28, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Analizira sopstveni rad i rad radne grupe za obavljanje posla\r\n•	Planira i organizuje sopstveni rad i rad radne grupe za obavljanje poslova prodaje\r\n•	Izvrši ličnu pripremu i kontrolu potrebnih resursa i radnog mjesta za obavljanje posla\r\n•	Utvrdi stanje zaliha robe u cilju nesmetane realizacije prodaje\r\n•	Izvrši prijem porudžbenice, sastavljanje nacrta ugovora o prodaji i prikupljanje podataka o isporuci robe i naplati potraživanja\r\n•	Kontroliše preuzimanje i pripremanje robe za prodaju\r\n•	Izvrši kontrolu izlaganja i pozicije određenog asortimana robe, u skladu sa planogramom\r\n•	Usluži kupca, u skladu sa tipom i karakteristikama kupca i različitim načinima i vrstama prodaje\r\n•	Izvrši nadzor blagajne i naplate računa, u skladu sa propisima o blagajničkom poslovanju\r\n•	Obavi poslove nabavke, kontrole stanja zaliha robe i pripreme za popis u maloprodaji\r\n•	Izvrši kalkulaciju maloprodajne cijene koštanja proizvoda i nivelaciju cijena\r\n•	Obavi promotivne poslove u cilju unapređenja prodaje\r\n•	Prati tržište u cilju prikupljanja podataka o djelovanju konkurencije\r\n•	Vodi trgovačku knjigu, evidencije o blagajničkom poslovanju, radnom učinku, prihodima i rashodima maloprodajnog objekta i ostalu poslovnu dokumentaciju iz djelokruga svoga rada\r\n•	Rukovodi radom pojedinca ili radnom grupom za realizaciju radnog zadatka u maloprodajnom objektu\r\n•	Obavi poslove, u skladu sa standardima struke\r\n•	Kontroliše stanje maloprodajnog objekta i tehničke opreme u trgovini\r\n•	Komunicira sa kupcima, nadređenima, saradnicima i dobavljačima, u skladu sa pravilima poslovne komunikacije\r\n•	Sprovede mjere zaštite i zdravlja na radu, i zaštite životne sredine\r\n'),
(29, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Planira, organizuje i priprema potrebne resurse za održavanje brodskih mašina i uređaja, brodske konstrukcije i konstrukcije brodskih mašina i uređaja\r\n•	Upravlja, kontroliše i održava glavnu pogonsku mašinu na brodu\r\n•	Upravlja, kontroliše i održava brodske pomoćne mašine i uređaje\r\n•	Upravlja, kontroliše i održava brodske parne kotlove\r\n•	Upravlja, kontroliše i održava brodske električne mašine i uređaje\r\n•	Održava i popravlja brodsku konstrukciju i konstrukciju brodskih mašina i uređaja\r\n•	Sprovede postupke održavanja i skladištenja goriva, maziva, vode, hemikalija i zapaljivih materija, u skladu sa odgovarajućom procedurom\r\n•	Vodi potrebnu dokumentaciju u mašinskom prostoru, u odgovarajućoj formi\r\n•	Komunicira sa oficirima i članovima posade broda, u skladu sa pravilima komunikacije\r\n•	Pruži prvu medicinsku pomoć na brodu, u skladu sa odgovarajućom procedurom\r\n•	Primijeni mjere međunarodnih i nacionalnih propisa o zaštiti i zdravlju na radu, i zaštiti okoline\r\n\r\n'),
(30, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Planira i organizuje sopstveni rad i potrebne resurse za pripremu broda za manevrisanje, upravljanje navigacijskom opremom i uređajima, ukrcaj i iskrcaj tereta i putnika, i sprovođenje mjera za održavanje sigurnosti ljudi i broda\r\n•	Pripremi brod za manevrisanje i navigacioni most za navigaciju\r\n•	Vodi navigaciju broda prema instrukcijama\r\n•	Kormilari brodom, u skladu sa instrukcijama\r\n•	Manevriše i rukuje brodom prema instrukcijama\r\n•	Izvrši pripremne poslove kod ukrcaja i iskrcaja tereta sa broda\r\n•	Rukuje i slaže brodski teret i vodi brigu o putnicima\r\n•	Održava sigurnost i bezbjednost ljudi i broda, u skladu sa odgovarajućom procedurom\r\n•	Vodi brodsku dokumentaciju, u odgovarajućoj formi\r\n•	Održava brod, brodsku opremu i uređaje, u skladu sa odgovarajućom procedurom i uputstvom\r\n•	Komunicira sa posadom, osobljem terminala i na relaciji brod - brod i brod – kopno, u skladu sa pravilima komunikacije\r\n•	Pruži prvu medicinsku pomoć na brodu, u skladu sa odgovarajućom procedurom\r\n•	Primijeni mjere međunarodnih i nacionalnih propisa o zaštiti i zdravlju na radu, i zaštiti okoline');
INSERT INTO `ciljevi` (`ID`, `naziv`) VALUES
(31, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Planira i organizuje sopstveni rad i rad pomoćnih frizera za pružanje frizerskih usluga\r\n•	Njeguje kosu, vlasište, bradu, brkove i kožu lica korisniku usluga\r\n•	Šiša kosu korisniku usluga različitim tehnikama\r\n•	Izradi namjenske muške i ženske frizure, koristeći različite tehnike\r\n•	Izvrši brijanje i oblikovanje brade i brkova i brijanje glave različitim tehnikama\r\n•	Izvrši specijalno bojenje kose, brade i brkova korisniku usluga različitim tehnikama\r\n•	Izvrši završne radove u salonu\r\n•	Izvrši nabavku, prezentaciju i prodaju alata, pribora i materijala\r\n•	Komunicira sa korisnicima usluga, poslovnim partnerima i saradnicima, koristeći pravila poslovne komunikacije i poslovnog bontona\r\n•	Sprovede postupke i mjere zaštite i zdravlja na radu, i zaštite okoline'),
(32, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Organizuje sopstveni rada za pružanje pomoćnih frizerskih usluga\r\n•	Pripremi potrebne resurse i radno mjesto za pružanje pomoćnih frizerskih usluga\r\n•	Izvrši osnovnu njegu kose, vlasišta, kože lica, brade i brkova korisniku usluga\r\n•	Izvrši jednostavno šišanje kose korisniku usluga, koristeći osnovne tehnike\r\n•	Pripremi lice i glavu korisnika usluga za brijanje i oblikovanje brade i brkova\r\n•	Izvrši pripremu i izradu jednostavnih dnevnih frizura\r\n•	Izvrši pomoćne poslove pri prepariranju kose korisniku usluga\r\n•	Izvrši osnovno bojenje kose koristeći odgovarajuće tehnike i alat\r\n•	Izvrši završne radove u salonu\r\n•	Čisti alat i pribor koji koristi u radu\r\n•	Komunicira sa korisnicima usluga i saradnicima, koristeći pravila poslovne komunikacije i poslovnog bontona\r\n•	Sprovede postupke i mjere zaštite i zdravlja na radu, i zaštite okoline'),
(33, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Pripremi materijal, pribor i opremu za obavljanje poslova, u skladu sa standardima struke\r\n•	Izradi ručno ili kompjuterski konstrukciju osnovnog kroja tekstilnih i odjevnih proizvoda\r\n•	Modeluje ručno ili kompjuterski osnovni kroj tekstilnih i odjevnih proizvoda\r\n•	Gradira krojeve u različitim veličinama, u skladu sa standardima struke\r\n•	Preporuči odgovarajući prirodni ili vještački tekstilni materijal za određenu namjenu u zavisnosti od njegovih karakteristika i načina održavanja\r\n•	Izradi modne skice i crteže na osnovu zadatog dizajna\r\n•	Izradi tehničke skice po zadatom dizajnu za izradu modnih i konfekcijskih proizvoda\r\n•	Izradi tekstilne i odjevne proizvode, rukujući alatom za krojenje, osnovnim i specijalnim mašinama za šivenje, automatima i agregatima, peglama i presama, u skladu sa standardima struke i mjerama zaštite na radu\r\n•	Izvrši korekcije gotovih konfekcijskih i modnih tekstilnih i odjevnih proizvoda\r\n•	Prati izradu tekstilnih i odjevnih proizvoda i primjenu standarda i normativa kvaliteta, u skladu sa standardima struke\r\n•	Izradi tehničko – tehnološku dokumentaciju, u skladu sa proizvodnim procesom\r\n•	Promoviše i prodaje izrađene unikatne tekstilne i odjevne proizvode na tržištu\r\n•	Komunicira sa saradnicima i strankama koristeći pravila poslovne komunikacije\r\n•	Primijeni standarde struke usklađene sa propisima iz oblasti zaštite životne sredine'),
(34, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Pripremi radni prostor za krojenje tekstilnih i odjevnih proizvoda\r\n•	Leguje materijal, polaže krojnu sliku na naslagu, ucrtava i obilježava krojne djelove\r\n•	Kroji ucrtane krojne djelove tekstilnih i odjevnih proizvoda\r\n•	Izvrši vezivanje krojnih djelova i pozamanterije u svežnjeve prema zadatom modelu u radnom nalogu\r\n•	Spoji iskrojene djelove tekstilnih i odjevnih proizvoda na osnovnim mašinama za šivenje, šivaćim automatima i agregatima, peglama i presama\r\n•	Preporuči odgovarajući prirodni ili vještački tekstilni materijal za određenu namjenu u zavisnosti od njegovih karakteristika i načina održavanja\r\n•	Prepravi sašivene i ručno izrađene tekstilne i odjevne proizvode\r\n•	Nabavi pribor za šivenje i krojenje, materijal i pozamanteriju za samostalnu konfekcijsku i tekstilnu radionicu\r\n•	Odredi cijene usluga u samostalnoj konfekcijskoj i tekstilnoj radionici\r\n•	Obavi poslove, u skladu sa normativima i standardima kvaliteta u tekstilstvu\r\n•	Održava funkcionalnost alata za krojenje i mašina za šivenje sa kojima rukuje tokom rada\r\n•	Obavi poslove, u skladu sa standardima zdravstvene zaštite, radne i životne sredine\r\n'),
(35, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Analizira radni zadatak u cilju pripreme za njegovu realizaciju\r\n•	Planira i organizuje sopstveni rad za realizaciju radnog zadatka\r\n•	Vrši prijem dokumentacije i robe za uvozni/izvozni postupak\r\n•	Obradi primljenu dokumentaciju za uvozni/izvozni postupak\r\n•	Obradi jedinstvenu carinsku ispravu u uvoznom/izvoznom postupku\r\n•	Kontroliše jedinstvenu carinsku ispravu dobijenu od nadležnog carinskog organa\r\n•	Sprovede mjere carinskog nadzora u putničkom i robnom transportu\r\n•	Sprovede carinsku kontrolu putnika, prevoznih sredstava, robe i sredstava plaćanja u međunarodnom saobraćaju\r\n•	Sprovede postupke sa akciznom robom\r\n•	Unese i obradi podatke o robi u carinski informacioni sistem i druge operativne sisteme\r\n•	Vrši naplatu i kontrolu prihoda carinske službe\r\n•	Izradi ponudu za uslugu prevoza robe i daje nalog vozaru\r\n•	Organizuje transport robe i poslove prilikom dolaska robe na odredište\r\n•	Organizuje osiguranje robe koja se prevozi i prevoznog sredstva kod osiguravajućeg društva\r\n•	Posreduje prilikom prevoza robe\r\n•	Analizira tržište i promoviše špediterske i transportne usluge\r\n•	Ispuni radnu dokumentaciju i vodi evidenciju u odgovarajućoj formi\r\n•	Osigura kvalitet rada, u skladu sa propisima iz oblasti špedicije, carine i transporta\r\n•	Komunicira sa nadređenima, saradnicima i strankama, u skladu sa pravilima poslovne komunikacije\r\n•	Koristi informacione i telekomunikacione tehnologije u radu\r\n•	Primjenjuje postupke i mjere zaštite na radu, zdravlja i radne i životne sredine, u skladu sa propisima\r\n'),
(36, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Analizira i planira rad u proizvodnji hemijskih i farmaceutskih industrijskih proizvoda za određene faze tehnološkog procesa i u hemijskoj laboratoriji\r\n•	Organizuje sopstveni rad i rad radne grupe, u skladu sa dnevnim i nedjeljnim zaduženjima \r\n•	Pripremi uslove i radno mjesto za proces proizvodnje, u skladu sa planom proizvodnje industrijskih hemijskih i farmaceutskih proizvoda i za obavljanje poslova u hemijskoj laboratoriji \r\n•	Izvede mehanički, toplotni i difuzioni tehnološki proces u proizvodnji industrijskih hemijskih i farmaceutskih proizvoda \r\n•	Izvrši automatsku regulaciju tehnološkog procesa proizvodnje hemijskih industrijskih proizvoda \r\n•	Izvrši kontrolu obavljanja unutrašnjeg transporta, pakovanja i skladištenja u proizvodnji hemijskih industrijskih proizvoda\r\n•	Izvede tehnološki proces proizvodnje i pakovanja čvrstih, polučvrstih i tečnih oblika, suspenzija, emulzija, pjena, aerosoli, ekstrakata, tinktura i etarskih ulja u farmaceutskoj industriji\r\n•	Izvrši poslove u tehnološkom procesu dobijanja prečišćene i visoko prečišćene vode \r\n•	Izvrši kontrolu pripremnih poslova za izvođenje hemijskih analiza i skladištenje hemikalija \r\n•	Uzorkuje čvrste, tečne i gasovite materijale\r\n•	Pripremi rastvore za izvođenje hemijskih analiza \r\n•	Pripremi uzorke za hemijsku analizu i za instrumentalne metode analize \r\n•	Izvede hemijske analize - Izvede određene instrumentalne metode analize \r\n•	Izradi specifikacije potrebnog materijala za rad i zaštitnih sredstava za realizaciju radnih zadataka \r\n•	Izvrši preuzimanje i povraćaj materijala u skladište \r\n•	Izvrši vođenje radne dokumentacije u tehnološkom procesu proizvodnje industrijskih hemijskih i farmaceutskih proizvoda i pri obavljanju poslova u hemijskoj laboratoriji \r\n•	Rukovodi i nadzire radnu grupu za realizaciju tehnološkog procesa proizvodnje industrijskih hemijskih proizvoda ili određenih faza tehnološkog procesa\r\n•	Primijeni standarde struke u svim segmentima radnog procesa\r\n•	Izvrši kontrolu osnovnog održavanja sredstava za rad u tehnološkom procesu proizvodnje industrijskih hemijskih i farmaceutskih proizvoda \r\n•	Izvrši praćenje higijensko-tehničkih uslova u pogledu aparata i opreme za izvođenje hemijskih analiza \r\n•	Komunicira sa saradnicima i nadređenima tokom radnog procesa, primjenjujući pravila poslovne komunikacije \r\n•	Sprovede postupke i mjere za zaštitu na radu, zaštitu okoline i očuvanje zdravlja\r\n'),
(37, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Planira i organizuje sopstveni rad, u skladu sa dnevnim zaduženjima i standardima struke\r\n•	Pripremi osnovne resurse i radno mjesto za proces proizvodnje industrijskih hemijskih proizvoda i obavljanje poslova u hemijskoj laboratoriji\r\n•	Rukuje mašinama i uređajima u toku izvođenja faza mehaničkog tehnološkog procesa u proizvodnji hemijskih industrijskih proizvoda, u skladu sa radnim nalogom i recepturom\r\n•	Rukuje mašinama i uređajima u toku izvođenja faza toplotnog tehnološkog procesa u proizvodnji hemijskih industrijskih proizvoda, u skladu sa radnim nalogom i recepturom\r\n•	Rukuje mašinama i uređajima u toku izvođenja faza difuzionog tehnološkog procesa u proizvodnji hemijskih industrijskih proizvoda, u skladu sa radnim nalogom i recepturom\r\n•	Obavi unutrašnji transport, pakovanje i skladištenje u proizvodnji hemijskih industrijskih proizvoda\r\n•	Izvrši pripremne poslove za izvođenje hemijskih analiza i skladištenje hemikalija\r\n•	Izvrši pripremne i završne poslove pri uzorkovanju čvrstih, tečnih i gasovitih materijala\r\n•	Izvede osnovne operacije i tehnike rada u laboratoriji\r\n•	Izvede gravimetrijske i volumetrijske metode hemijske analize\r\n•	Obezbijedi materijal i sredstva za rad, u skladu sa radnim nalogom i dobijenim zadatkom\r\n•	Vodi radnu dokumentaciju tokom izvršenja radnih zadataka\r\n•	Primijeni standarde struke u domenu svoga rada\r\n•	Obavi osnovno održavanje sredstava za rad u proizvodnji industrijskih hemijskih proizvoda\r\n•	Provjeri higijensko-tehničke uslove u pogledu aparata i opreme za izvođenje hemijskih analiza\r\n•	Komunicira sa saradnicima i nadređenima tokom radnog procesa, primjenjujući pravila poslovne komunikacije\r\n•	Sprovede postupke i mjere za zaštitu na radu, zaštitu okoline i očuvanje zdravlja\r\n'),
(38, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Analizira radni zadatak, planira realizaciju i organizuje sopstveni rad i rad grupe za realizaciju poslova razvoja veb i moblnih aplikacija\r\n•	Obezbijedi resurse i pripremi radno mjesto za realizaciju poslova razvoja veb i moblnih aplikacija\r\n•	Instalira razvojno i produkciono okruženje za razvoj veb i mobilnih aplikacija\r\n•	Instalira razvojno i servisno okruženje za razvoj mobilnih aplikacija\r\n•	Izradi veb i mobilne aplikacije na zahtjev korisnika\r\n•	Sprovede postupke testiranja i održavanja veb i mobilnih aplikacija\r\n•	Izvrši kreiranje multimedijalnog sadržaja za veb i mobilne aplikacije\r\n•	Upravlja bazama podataka\r\n•	Koristi stručnu terminologiju i tehničku dokumentaciju na engleskom jeziku\r\n•	Izvrši procjenu troškova za realizaciju radnog zadatka\r\n•	Izradi radnu dokumentaciju prema propisanoj proceduri\r\n•	Rukovodi radnom grupom za realizaciju radnog zadatka i izvrši nadzor nad poslovima koje grupa izvodi\r\n•	Sprovede postupke za kontrolu kvaliteta i kvantiteta rada, u skladu sa normativima i drugim propisima\r\n•	Održava alat za rad\r\n•	Komunicira sa nadređenima, saradnicima i korisnicima usluga koristeći pravila poslovne komunikacije\r\n•	Sprovede postupke i mjere za zaštitu na radu, zaštitu okoline i očuvanje zdravlja'),
(39, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Razvijanje kod učenika, sposobnosti zapažanja, kritičkog prosuđivanja vrijednosti umjetničkog djela.\r\n•	Razvijanje osjećaja prema umjetnosti i kulturi.\r\n•	Razvijanje kreativnosti.\r\n•	Poznavanje opšte slikarske terminologije.\r\n•	Razvijanje likovne pismenosti.\r\n•	Razvijanje ličnosti učenika.\r\n•	Sticanje opažajnih sposobnosti.\r\n•	Sticanje osjećaja za treću dimenziju.\r\n•	Sticanje estetskih vrijednosti.\r\n•	Sticanje samopouzdanja u radu.\r\n•	Poznavanje likovne problematike.\r\n•	Poznavanje teorije likovnog djela.\r\n•	Sticanje znanja, verifikacijom i izradom vježbi.\r\n•	Sticanje osjećaja za kompoziciju i njene elemente.\r\n'),
(40, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Razvijanje sposobnosti zapažanja, kritičkog prosuđivanja vrijednosti prozvoda grafičkog dizajna.\r\n•	Praćenje trendove u grafičkom dizajnu.\r\n•	Osposobljenost za rad na računaru u grafičkim programima.\r\n•	Razvijanje sposobnosti vladanja principima dizajna.\r\n•	Poznavanje tipografije, njenih elemenata i načela.\r\n•	Razvijanje sposobnosti vladanja osnovama crtanja, slikanja, grafike.\r\n•	Razvijanje sposobnosti za izradu ilustracije i primjenu u okvirima grafičkog dizajna.\r\n•	Osmišljavanje izrade sredstava u slobodnom prostoru (bilbordi, svijetleće reklame, panoi…).\r\n•	Osmišljavanje vizuelnog identiteta firme, logotipa i njegove primjenljivosti na papirnoj galanteriji i propagandnom materijalu.\r\n•	Razvijanje sposobnosti osmišljavanja i realizacije projekta knjige (likovno – grafičko oblikovanje).\r\n•	Sticanje znanja za pripremu materijala za digitalnu i offset štampu.\r\n•	Poznavanje i poštovanje propisa autorskog prava.\r\n•	Poznavanje jednog stranog jezika.\r\n•	Poznavanje propisa iz ekologije.\r\n'),
(41, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Omogućuvanje svestranog razvoja pojedinca i njegove socijalne integracije.\r\n•	Produbljivanje i proširivanje opšteg obrazovanje u funkciji struke.\r\n•	Obezbijeđivanje stručno-teorijskih i praktičnih znanja, neophodnih za kvalitetan rad u zanimanju.\r\n•	Pripremanje učenika za permanentno obrazovanje i cjeloživotno učenje.\r\n•	Razvijanje sposobnosti socijalne komunikacije i spremnosti za razvijanje kvalitetnih međuljudskih odnosa. \r\n•	Osposobljavanje učenika za čitanje tehničkih crteža i tehnološke dokumentacije,\r\n•	Osposobljavanje učenika za postavljanje standardnih dijagnoza o stanju vozila, uz upotrebu odgovarajućih alata, uređaja i instrumenata.\r\n•	Osposobljavanje učenika da ugrađuju, održavaju i popravljaju mehaničke sisteme, uređaje i njihove sklopove.\r\n•	Osposobljavanje učenika da ugrađuju, održavaju i popravljaju elektronske i električne sisteme, uređaje i sklopove.\r\n•	Osposobljavanje učenika da ugrađuju, održavaju i popravljaju pneumatske i hidraulične sisteme, uređaje i njihove sklopove.\r\n•	Osposobljavanje učenika da opremaju motorno vozilo sa dodatnom opremom I priborom.\r\n•	Osposobljavanje učenika da savjetuju stranke u vezi sa popravkama i održavanjem dijelova na vozilu.\r\n•	Osposobljavanje učenika da ispunjavaju potrebnu radnu dokumentaciju i dokumenta o evidenciji stanja alata, instrumenata i uređaja, uz upotrebu računara.\r\n•	Razvijanje kod učenika ekološke svijesti i upoznavanje sa propisima o zaštiti na radu i zaštiti okoline i važnosti njihovog dosljednog poštovanja.\r\n'),
(42, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Omogućavanje svestranog razvoja pojedinca i njegove socijalne integracije.\r\n•	Produbljivanje i proširivanje opšteg obrazovanja u funkciji struke i obezbijediti stručno-teorijska i praktična znanja iz područja instalacija vodovoda,  sanitarija, grijanja, hlađenja i klimatizacije.\r\n•	Osposobljavanje učenika za izradu elemenata i podsklopova za instalacije centralnog grijanja kao što su: rezanje,  savijanje i spajanje cijevi, rezanje navoja, izrada prirubnica, držača, oslonaca.\r\n•	Osposobljavanje učenika za postavljanje vodovodnih instalacija i sanitarnih uređaja.\r\n•	Osposobljavanje učenika za montažu grejnih tijela, kotlova, aparata, pumpi, sigurnosnih elemenata.\r\n•	Osposobljavanje učenika za izradu i pripremu elemenata za klimatizaciju i ventilaciju.\r\n•	Osposobljavanje učenika za ugradnju elemenata klima uređaja.\r\n•	Osposobljavanje učenika za kontrolu instalacija za grijanje, klimatizaciju i instalaciju i njihovo održavanje i učešće u ispitivanju.\r\n•	Pripremanje učenika  za permanentno obrazovanje i  cjeloživotno učenje.\r\n•	Razvijanje kod učenika sposobnosti socijalne komunikacije i spremnost za razvijanje međuljudskih odnosa.\r\n•	Osposobljavanje učenika za planiranje, pripremu, izvođenje, kontrolu i vrjednovanje rada u  zanimanju.\r\n•	Razvijanje kod učenika  ekološke svijesti i upoznavanje sa propisima zaštite i znanja neophodna za njihovu primjenu  pri  radu.\r\n\r\n'),
(44, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Sticanje znanja o vrstama materijala.\r\n•	Upoznavanje sa svojstvima tehničkih materijala i mogućnosti njihove primjene u\r\n•	mašinstvu.\r\n•	Sticanje neophodnih znanja o strukturi materijala i uticaju strukture na promjenu svojstava materijala.\r\n•	Osposobljavanje za pravilan i racionalan izbor materijala.\r\n•	Upoznavanje sa načinom označavanja po standardu mašinskih materijala.\r\n•	Upoznavanje sa vrstama, svojstvima i primjenom plastičnih, gumenih i kompozitnih materijala.\r\n•	Upoznavanje sa vrstama, svojstvima i primjenom materijala za zaštitu i opravku limarskih i autolimarskih konstrukcija (boje, lakovi, plastika i dr).\r\n•	Upoznavanje sa osobinama, vrstama i primjenom goriva, maziva i pomoćnih materijala.\r\n•	Naučiti da koriste priručnike, standarde, tabele i druge vrste stručnih tekstova.\r\n•	Poštovanje ekoloških zahtjeva i razvijanje osjećaja za ekonomičnu upotrebu materijala.\r\n•	Razvijanje osjećaja poštovanja i brige za očuvanje životne sredine i zaštite na radu.\r\n•	Razvijanje osjećaja odgovornosti i preciznosti u radu.\r\n•	Ovladavanje stručnom terminologijom, neophodnom za komuniciranje u struci.\r\n'),
(45, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Omogućavanje svestranog razvoja pojedinca i njegove socijalne integracije.\r\n•	Osposobiti učenika za planiranje, pripremu, izvođenje, kontrolu i vrednovanje rada u zanimanju. Osposobiti učenika za čitanje tehničke dokumentacije.\r\n•	Produbljivanje i proširivanje opšteg obrazovanja u funkciji struke i obezbijediti stručno-teorijska i praktična znanja, za kvalitetan rad u zanimanju.\r\n•	Osposobiti učenika za siječenje, oblikovanje i spajanje djelova od lima.\r\n•	Osposobiti učenika za izradu, montažu i izvodu i površinsku zaštitu limarskih konstrukcija.\r\n•	Osposobiti učenika za rukovanje alatima za stezanje, obradu, mjerenje I kontrolu.\r\n•	Osposobiti učenika da izvodi radove održavanja na limarskim konstrukcijama.\r\n•	Sticanje znanja za ispunjavanje potrebne radne dokumentacije i dokumenta o evidenciji stanja mašina, uređaja i pribora.\r\n•	Sticanje osnovnih znanja o preduzetništvu.\r\n•	Razvijati sposobnost socijalne komunikacije i spremnost za razvijanje međuljudskih odnosa.\r\n•	Razvijati ekološku svijest i odgovornost u poštovanju mjera zaštite na radu I zaštiti okoline.\r\n'),
(46, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Omogućavanje svestranog razvoja pojedinca i njegove socijalne integracije.\r\n•	Osposobljavanje učenika za planiranje, pripremu, izvođenje, kontrolu i vrednovanje rada u zanimanju.\r\n•	Osposobljavanje učenika za čitanje tehničke dokumentacije.\r\n•	Produbljivanje i proširivanje opšteg obrazovanja u funkciji struke i obezbijeđivanje stručno-teorijskih i praktičnih znanja, za kvalitetan rad u zanimanju.\r\n•	Osposobljavanje učenika za rezanje i obradu djelova električnim lukom i gasnim postupkom.\r\n•	Osposobljavanje učenika za zavarivanje i navarivanje djelova ručnim i elektrolučnim postupkom.\r\n•	Osposobljavanje učenika za zavarivanje električnim lukom u zaštiti inertnih gasova I mješavini gasova.\r\n•	Osposobljavanje učenika za spajanje djelova elektrootpornim zavarivanjem. \r\n•	Osposobljavanje učenika za zavarivanje, navarivanje i siječenje djelova gasnim postupkom.\r\n•	Osposobljavanje učenika za spajanje djelova postupkom mekog i tvrdog lemljenja.\r\n•	Rukovanje alatima, priborima i uređajima za zavarivanje.\r\n•	Sticanje znanja za ispunjavanje potrebne radne dokumentacije i dokumenata o evidenciji stanja, uređaja i pribora.\r\n•	Sticanje osnovnih znanja o preduzetništvu.\r\n•	Brinuti o vlastitim aspektima zdravlja i zdravlja svojih kolega.\r\n•	Primijeninjivanje zaštite od opasnosti I sprovođenje mjera zaštite, mjera bezbjednosti I sprečavanje nesreća.\r\n•	Razvijanje sposobnosti socijalne komunikacije i spremnost za razvijanje međuljudskih odnosa.\r\n•	Razvijanje ekološke svijesti i odgovornosti u poštovanju mjera zaštite na radu i zaštiti okoline.\r\n'),
(47, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Omogućavanje svestranog razvoja pojedinca i njegove socijalne integracije.\r\n•	Produbljivanje i proširivanje opšteg obrazovanja u funkciji struke i obezbijediti stručno-teorijska i praktična znanja, neophodna za kvalitetan rad u zanimanju.\r\n•	Pripremanje učenika za permanentno obrazovanje i cjeloživotno učenje.\r\n•	Razvijanje sposobnosti socijalne komunikacije i spremnost za razvijanje kvalitetnih   međuljudskih odnosa.\r\n•	Posjedovanje znanja za čitanje tehničkih crteža i tehnološke dokumentacije.\r\n•	Posjedovanje informatičke pismenosti.\r\n•	Posjedovanje preduzetničkih sposobnosti.\r\n•	Sposobnost izrađivanja šablona.\r\n•	Sposobnost izrađivanja steznih alata.\r\n•	Sposobnost izrađivanja alata za savijanje, probijanje, prosijecanje, izvlačenje kombinovanih alata.\r\n•	Sposobnost izrađivanja alata za kovanje, krzanje, presovanje i livenje.\r\n•	Sposobnost izrađivanja modela za kopiranje.\r\n•	Sposobnost izrađivanja alata za graviranje.\r\n•	Rukovanje alatima za stezanje, obradu, mjerenje i kontrolu.\r\n•	Rukovanje mašinama za izradu alata.\r\n•	Popravljanje alata koje izrađuje.\r\n•	Ispunjavanje potrebne radne dokumentacije i dokumenta o evidenciji stanja  mašina, uređaja i opreme.\r\n•	Pripremanje elemenata kalkulacija.\r\n•	Primjenjivanje pri radu standarda kvaliteta.\r\n•	Razvijanje ekološke svijesti i odgovornosti u poštovanju mjera zaštite na radu i zaštiti okoline.\r\n'),
(48, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Planiranje, pripremanje, organizovanje i kontrola svoga rada i rada grupe.\r\n•	Racionalno korišćenje sredstava rada, energije, materijala i vremena.\r\n•	Izrada tehničkih crteža.\r\n•	Izrada i mijenjanje 3D modela mašinskih elemenata.\r\n•	Izrada i mijenjanje tehničke dokumentacije, urađene na osnovu 3D modela.\r\n•	Konstruisanje manje složenih alata.\r\n•	Izrada tehnološke dokumentacije.\r\n•	Izrada jednostavnih programa.\r\n•	Rad na CNC mašinama.\r\n•	Rad i provjera programa i izrada obradaka na CNC mašini.\r\n•	Planiranje i terminiranje proizvodnje.\r\n•	Skladištenje i otprema proizvoda.\r\n•	Osiguravanje kvaliteta u skladu sa standardima i normativima.\r\n•	Razvijanje preduzetničkih osobina, vještina i ponašanja.\r\n•	Zaštita zdravlja i okoline.\r\n'),
(49, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Osposobljavanje za planiranje, pripremanje, rad i provjera kvaliteta obavljenog posla.\r\n•	Posjedovanje osnovnih znanja o propisima, normativima i standardima u energetici.\r\n•	Osposobljavanje za analizu tehničke dokumentacije energetskih sistema.\r\n•	Planiranje i terminiranje montaže energetskih postrojenja.\r\n•	Učestvovanje u montiranju termoenergetskih postrojenja.\r\n•	Učestvovanje u montiranju gasoenergetskih i pneumoenergetskih postrojenja.\r\n•	Učestvovanje u montiranju hidroenergetskih postrojenja.\r\n•	Učestvovanje u montaži nekonvencionalnih energetskih postrojenja.\r\n•	Planiranje optimalnog vođenja postrojenja sa stanovišta ekonomičnosti i sigurnosti.\r\n•	Osposobljavanje za izradu plana regulacije, održavanja i remontovanja postrojenja i uređaja.\r\n•	Posjedovanje sistematičnosti i odgovornosti u radu.\r\n•	Poznavanje jednog stranog jezika.\r\n•	Posjedovanje informatičke pismenosti.\r\n•	Racionalno korišćenje sredstava za rad, materijala, energije i vremena.\r\n•	Osposobljavanje za primjenu propisa zaštite na radu i zaštite okoline.\r\n'),
(50, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Produbljivanje i proširivanje opšteg obrazovanja u funkciji struke i obezbjeđivanje stručno teorijskih i praktičnih znanja za samostalno obavljanje zanimanja.\r\n•	Razvijanje sposobnosti komunikacije, spremnost za razvijanje međuljudskih odnosa.\r\n•	Poznavanje osnova građevinarstva i građevinskih elemenata zgrade.\r\n•	Poznavanje organizacije gradilišta.\r\n•	Poznavanje materijala za keramičarske radove.\r\n•	Poznavanje pravila za zidanje i malterisanje.\r\n•	Osposobljavanje za zidanje pregradnih zidova i zidova ispune od opeke.\r\n•	Osposobljavanje za ručno i mašinsko spravljanje maltera.\r\n•	Osposobljavanje za postavljanje keramičkih pločica.\r\n•	Poznavanje elemenata kalkulacije za keramičarske radove, zna izraditi kalkulaciju za jednostavne keramičarske radove.\r\n•	Razvijanje ekološke svijesti i odgovornosti u poštovanju mjera zaštite na radu i zaštiti okoline.\r\n'),
(51, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Omogućava svestrani razvoj pojedinca i njegovu socijalnu integraciju.\r\n•	Produbljuje i proširuje opšte obrazovanje u fukciji struke i obezbjeđuje stručno teorijska i praktična znanja za samostalno obavljanje zanimanja.\r\n•	Razvija sposobnost socijalne komunikacije, spremnost za razvijanje međuljudskih odnosa.\r\n•	Osposobljava se za rad u području suve gradnje.\r\n•	Upoznaje se sa rukovanjem i održavanjem alata, pribora i mašina za sistem suve gradnje.\r\n•	Osposobljava se za izvođenje radova na oblaganju zidova, stubova i greda, gips kartonskim pločama.\r\n•	Upoznaje se sa izvođenjem radova na plafonima sa drvenom i metalnom podkonstrukcijom.\r\n•	Upoznaje se sa montažom pregradnih zidova sa jednostrukom i dvostrukom metalnom podkonstrukcijom.\r\n•	Osposobljava se za izradu suvih estriha i za primjenu epoksidnih podova.\r\n•	Upoznaje se sa elementima kalkulacije i komunikacije sa saradnicima.\r\n•	Razvijanje ekološke svijesti i odgovornosti u poštovanju mjera zaštite na radu i zaštiti okoline.\r\n'),
(52, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Produbljuje i proširuje opšte obrazovanje u fukciji struke i obezbjeđuje stručno teorijska i praktična znanja za samostalno obavljanje zanimanja.\r\n•	Pripremanje za permanentno obrazovanje i cjeloživotno učenje.\r\n•	Razvijanje sposobnosti socijalne komunikacije i spremnosti za razvijanje međuljudskih odnosa.\r\n•	Upoznavanje sa osnovnim principima funkcionisanja organizacije državne vlasti.\r\n•	Upoznavanje sa organizacijom i funkcionisanjem privrednog društva.\r\n•	Upoznavanje sa principima funkcionisanja savremene kancelarije i kancelarijskog poslovanja.\r\n•	Osposobljavanje za poslove poslovnog sekretara.\r\n•	Osposobljavanje za poslove vođenja evidencija o posjetama i sastancima, registara o poslovnim saradnicima, telefonskih imenika i adresara.\r\n•	Osposobljavanje za adekvatno uređenje i oblikovanje tekstova i pripreme materijala.\r\n•	Osposobljavanje za poslove organizovanja smještaja i prevoza.\r\n•	Osposobljavanje za oblikovanje jednostavnih dopisa, zahtjeva, molbi i drugih podnesaka.\r\n•	Posjedovanje znanja iz informatike i poznavanje stranog jezika.\r\n•	Razvijanje ekološke svijesti i odgovornosti u poštovanju mjera zaštite na radu i zaštiti okoline.\r\n'),
(53, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Omogućavanje svestranog razvoja pojedinca i njegove socijalne integracije.\r\n•	Produbljivanje i proširivanje opšteg obrazovanja u funkciji struke I obezbjeđivanje stručno teorijskih i praktičnih znanja za samostalno obavljanje zanimanja, pripreme za permanentno obrazovanje i doživotno učenje.\r\n•	Osposobljavanje za rad na prijemu i uzorkovanju mlijeka\r\n•	Osposobljavanje za rad na mašinama u primarnoj preradi, tehničkoj obradi I oblikovanju mliječnih proizvoda po tehnološkim šemama.\r\n•	Osposobljavanje za pakovanje mlijeka i mliječnih proizvoda u odgovarajućuambalažu.\r\n•	Razvijanje preduzetničkih sposobnosti.\r\n•	Osposobljavanje za zaštitu zdravlja, radne i životne sredine.\r\n•	Razvijanje sposobnosti socijalne komunikacije i spremnost za razvijanje međuljudskih  odnosa.\r\n•	Osposobljavanje za planiranje, pripremu, izvođenje, kontrolu i vrijednovanje rada u zanimanju.\r\n'),
(54, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Omogućavanje svestranog razvoja pojedinca i njegove socijalne integracije.\r\n•	Produbljivanje i proširivanje opšteg obrazovanja u funkciji struke.\r\n•	Obezbijediti stručno teorijska i praktična znanja iz ratarsko-povrtarske priozvodnje – osposobiti učenika da: \r\no	poznaje, odabira i koristi alat, matrijal i mehanizaciju.\r\no	priprema zemljište za ratarsko-povrtarsku proizvodnju.\r\no	obavlja proizvodnju rasada.\r\no	obavlja sjetvu i sadnju.\r\no	primjenjuje najznačajnije agrotehničke mjere.\r\no	priprema i koristi zaštićene prostore.\r\no	obavlja berbu i žetvu.\r\no	obavlja čuvanje i skladištenje.\r\n•	Pripremanje učenika za cjeloživotno učenje.\r\n•	Razvijanje kod učenika sposobnosti socijalne komunikacije i spremnost za razvijanje\r\n•	kvalitetnih međuljudskih odnosa.\r\n•	Osposobljavanje učenika da ispunjavaju potrebnu radnu dokumentaciju.\r\n•	Razvijanje ekološke svijesti i odgovornosti u poštovanju mjera zaštite na radu i zaštiti okoline.\r\n'),
(55, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Širenje opšteg obrazovanje u funkciji struke.\r\n•	Usvajanje stručno-teorijskih i praktičnih znanja iz rasadničarstva i cvjećarstva: odabir alata i materijala u rasadničkoj proizvodnji, sjemenske sastojine, sakupljanje sjemena i vizuelno utvrđivanje njegovog kvaliteta, formiranje rasadnika, priprema zemljišta i sjemena, proizvodnja sadnica i cvijeća generativnim i vegetativnim putem, njega i zaštita sadnica i cvjetnih kultura, zaštita sadnog materijala i cvjetnih kultura, aranžiranje cvijeća, za planiranje, pripremu, izvođenje, kontrolu i vrednovanje rada u zanimanju.\r\n•	Razvijanje pozitivnog stava o značaju permanentnog obrazovanja i cjeloživotnog učenje i da osposobljavanje za socijalnu komunikaciju i spremnost za razvijanje međuljudskih odnosa i timski rad. \r\n•	Upoznavanje sa opštepriphvaćenim, međunarodnim standardima u oblasti cvjećarstva i rasadničarstva.\r\n•	Razvijanje ekološke svijesti.\r\n•	Upoznavanje sa propisima o zaštiti bilja i sticanje znanja koja su neophodna za primjenu propisa pri radu.\r\n'),
(56, 'Ciljevi i zadaci obrazovnog programa su:\r\n\r\n•	Planiranje, pripremanje i izvođenje radova iz djelokruga svog zanimanja. \r\n•	Vršenje provjere kvaliteta obavljenog posla. \r\n•	Racionalno korišćenje energije, materijala i vremena. \r\n•	Posjedovanje osnovne informatičke pismenosti. \r\n•	Obavljanje poslova u proizvodnji voćnog i loznog sadnog materijala. \r\n•	Učestvovanje u podizanju voćnjaka i vinograda. \r\n•	Učestvovanje u formiranju uzgojnih oblika voćaka i vinove loze. \r\n•	Učestvovanje u berbi, pakovanju i čuvanju gotovih proizvoda. \r\n•	Kontrolisanje i učestvovanje u poslovima đubrenja ratarskih i povrtarskih kultura.\r\n•	Obavljanje poslova pripreme sjemena i vršenje pripremnih radnje za sjetvu i sadnju za njegovanje i zaštitu usjeva. \r\n•	Određivanje fiziološke i tehnološke zrelosti, načine ubiranja i skladištenja usjeva.\r\n•	Kontrolisanje i učestvovanje u poslovima izvođenja agrotehničkih operacija u poljoprivrednoj proizvodnji. \r\n•	Kontrolisanje i učestvovanje u poslovima tehnologije proizvodnje podmlatka. \r\n•	Kontrolisanje i učestvovanje u poslovima pri ishrani svih vrsta i kategorija domaćih životinja.\r\n•	Kontrolisanje i učestvovanje u poslovima pri dobijanju glavnih i sporednih proizvoda u stočarstvu. \r\n•	Vođenje matičnog knjigovodstva i kontrolisanje proizvodnih osobina.\r\n•	Kontrolisanje i učestvovanje u poslovima kod higijene smještaja i držanja domaćih životinja.\r\n•	Razlikovanje bolesne od zdravih životinja i njihovo odvajanje. \r\n•	Kontrolisanje i učestvovanje u radu sa različitim mašinama i sistemima u poljoprivrednoj proizvodnji. Primjenjivanje standarda kvaliteta pri radu.\r\n•	Poznavanje jednog stranog jezika. \r\n•	Primjenjivanje propisa zaštite na radu i zaštite životne sredine.\r\n'),
(57, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Omougućavanje svestranog razvoaj pojedinca i njegove socijalne integracije,\r\n•	Produbljivanje i proširivinaje opšteg obrazovanja u funkciji struke i obezbjeđivanje stručno teorijskih i praktičnih znanja za samostalno obavljanje zanimanja,\r\n•	Pripremanje za permanentno obrazovanje i cjeloživotno učenje,\r\n•	Razvijanje sposobnosti socijalne komunikacije i spremnost za razvijanje međuljudskih odnosa,\r\n•	Osposobljavanje učenika za planiranje, pripremu, izvođenje, kontrolu i vrjednovanjerada u zanimanju,\r\n•	Osposobljavanje učenika da samostalno, sigurno, ekonomično i kvalitetno, izrađuju stolarske proizvode (sto, ormar od masivnog drveta, ormar od masivnih ploča, ormara od furnirskih ploča, furnirskog namještaja, vrata, prozore, stepenica),\r\n•	Osposobljavanje učenika za sastavljanje industrijskog namještaja, za izradu i ugradnju građevinske stolarije kao i da upoznaju osnove starinskog namještaja,\r\n•	Osposobljavanje učenika  za planiranje i ekonomično izvođenje pojedinačne i industrijske proizvodnje, \r\n•	Razvijanje ekološke svijesti i odgovornosti u poštovanju mjera zaštite na radu i zaštiti okoline.\r\n'),
(58, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Omogućavanje svestranog razvoja pojedinca i njegove socijalne integracije.\r\n•	Produbljivanje i proširivanje opšteg obrazovanja u funkciji struke i obezbjeđivanje stručno-teorijskih i praktičnih znanja za samostalno obavljanje poslova u okviru zanimanja.\r\n•	Pripremanje za cjeloživotno obrazovanje i učenje.\r\n•	Razvijanje sposobnosti socijalne komunikacije i sposobnosti za razvijanje međuljudskih odnosa.\r\n•	Osposobljavanje učenika za planiranje, pripremu, izvođenje, kontrolu i vrijednovanje rada u zanimanju.\r\n•	Osposobljavanje učenika da samostalno, sigurno, ekonomično i kvalitetno obavljanje poslova na izradi proizvoda primarne prerade drveta (proizvodnja rezane građe, furnira, ploča od drveta, kuća od drveta i ostalih primarnih proizvoda).\r\n•	Razvijanje ekološke svijesti i odgovornosti u poštovanju mjera zaštite na radu i zaštiti okoline.\r\n'),
(59, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Razvijanje sposobnosti i vještine za kavalitetan rad u zanimanju.\r\n•	Razvijanje uspješne lične karijere u zanimanju.\r\n•	Osposobljavanje  za kritičko vrjednovanje i odgovorno djelovanje na svom random mjestu.\r\n•	Osposobljavanje za idejno rješavanje enterijera i namještaja od drveta.\r\n•	Sastavljanje režima i vođenja procesa parenja i sušenja drveta.\r\n•	Rukovanje zahtjevnijim mašinama za obradu drveta.\r\n•	Pripremanje jednostavne programe i rukuju CNC mašinama za obradu drveta.\r\n•	Pripremanje izvještaja o proizvodnji.\r\n•	Posjedovanje informatičke pismenosti za izradu crteža i dokumentacije.\r\n•	Poštovanje standarda kvaliteta u svom zanimanju i vrše kontrolu procesa.\r\n•	Razvijanje pravilnog odnosa prema saradnicima, strankama i okolini.\r\n•	Upoznavanje sa pojmom tržišta i uspješnog poslovanja.\r\n•	Razvijanje znanja za vođenje grupa, komunikaciju sa saradnicima pri radu I rješavanju problema, motivišu saradnike.\r\n•	Razvijanje sposobnosti na principu cjeloživotnog učenja.\r\n•	Razvijanje pravilnog odnosa prema zaštiti na radu i zaštiti čovjekove okoline.\r\n'),
(62, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Osposobljavanje učenika za planiranje, pripremu, izvođenje, kontrolu i vrednovanje rada u zanimanju.\r\n•	Razvijanje sposobnosti socijalne komunikacije i spremnosti za razvijanje međuljudskih odnosa.\r\n•	Razumijevanje normalne funkcije ljudskog organizma, proučavanjem paralelno samorfologijom, a time i sagledavanjem jedinstva građe i funkcije bitnog zamedicinsku praksu.\r\n•	Omogućavanje potrebnog profesionalnog znanja i vještina u cilju ovladavanja metodologijom zdravstveno-vaspitnog rada i sprovođenja higijenskih principa i mjera, u radu sa bolesnikom i održavanju higijene prostorija, namještaja I pribora.\r\n•	Osposobljavanje za sprovođenje odgovarajućih medicinsko-tehničkih radnji: pripreme bolesnika, materijala i dokumentacije za različite dijagnostičke procedure, uzimanja materijala za dijagnostička ispitivanja, pripreme materijala i instrumenata za rad u previjalištu, vođenje medicinske dokumentacije.\r\n•	Osposobljavanje za kontrolu vitalnih znakova pacijenta tokom procesa oporavka po principima zdravstvene njege, pripreme za vizitu, trebovanja hrane i sprovođenja vještačke ishrane, prijem i zbrinjavanja urgentnih stanja.\r\n•	Osposobljavanje za samostalno, sigurno, ekonomično i kvalitetno, obavljanjeposlova.\r\n•	Razvijanje ekološke svijesti, savjesti o poštovanju mjera zaštite na radu i njihove dosljedne primjene.\r\n•	Pripremanje učenika za permanentno obrazovanje i cjeloživotno učenje, produbljivanje i proširivanje opšteg obrazovanja u funkciji struke I obezbjeđivanje stručno-teorijskih i praktičnih znanja za samostalno obavljanje posla.\r\n'),
(64, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Omugućavanje svestranog razvoja pojedinca i njegove socijalne integracije.\r\n•	Produbljivanje i proširivanje opšteg obrazovanja u funkciji struke i obezbjeđjivanje stručno-teorijskih i praktičnih znanja za samostalno obavljanjeposla.\r\n•	Razvijanje sposobnosti socijalne komunikacije i spremnosti za razvijanje međuljudskih odnosa.\r\n•	Osposobljavanje učenika za planiranje, pripremu, izvođenje, kontrolu ivrednovanje rada u zanimanju.\r\n•	Omogućavanje razumijevanja normalne funkcije ljudskog organizma, proučavanjem paralelno sa morfologijom, a time i sagledanjem jedinstva građe I funkcije bitnog za laboratorijsku praksu.\r\n•	Osposobljavanje učenika za sprovođenje odgovarajućih laboratorijsko-tehničkih radnji, prijeme bolesnika, uzimanje i laboratorijsko ispitivanje uzoraka udijagnostičke I terapijske svrhe.\r\n•	Osposobljavanje učenika za:\r\no	neposrednu pripremu reageanasa, pribora i alata za rad, izvođenje osnovnih\r\no	biohemijskih analiza krvi, urina, fecesa i crijevnih sokova.\r\no	pripremu preparata i izvođenje osnovnih bakterioloških i parazitoloških analiza.\r\no	pripremu preparata za izvođenje osnovnih hematoloških analiza.\r\no	pripremu i izvođenje hemijskih i bromatoloških analiza.\r\no	vođenje stručne dokumentacije.\r\no	samostalno, sigurno, ekonomično i kvalitetno, obavljenje poslova.\r\n•	Razvijanje ekološke savijesti i savijesti o poštovanju mijera zaštite na radu I njihove doslijedne primjene.\r\n•	Pripremanje za permanentno obrazovanje i cjeloživotno učenje.\r\n'),
(65, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Produbljivanje i proširivanje opšteg obrazovanja u funkciji struke i obezbjeđivanje stručno-teorijskih i praktičnih znanja u cilju samostalnog obavljanje posla.\r\n•	Razvijanje sposobnosti socijalne komunikacije, timskog rada i spremnosti za razvijanje međuljudskih odnosa.\r\n•	Osposobljavanje učenika za planiranje, pripremu, izvođenje, kontrolu I vrednovanje kvaliteta sopstvenog rada.\r\n•	Omogućavanje potrebnog profesionalnog znanja neophodnog za adekvatno vođenje odgovarajuće medicinske dokumentacije, upisivanje i čuvanje podataka iz zdravstvene dokumentacije pacijenta, asistiranje stomatologu pri radu dodajući potrebne instrumente, materijale, smjese i dr.\r\n•	Osposobljavanje za izradu radnog modela-izlivanje otiska, izradu modela u vosku,  izradu fiksne proteze, različitih vrsta mostova,  krunica,  sprovođenje postupka zagrijavanja,  žarenja, livenja i topljenja,  oblikovanja i poliranja, izradu fasetiranja sa akrilatnom masom, izradu porcelanske i akrilatne navlake, izradu totalne i parcijalne proteze, parcijalne proteze sa metalnom bazom, podlaganje proteze i dr.\r\n•	Razvijanje vještina neophodnih za učestvovanje-asistiranje u terapiji pacijenata prema različitim metodama: konzervativnim, endodonskim, protetskim, ortodonskim, paradonskim, oralnim i drugim tretmanima, pripremanje pacijenta za operativni zahvat, vršenje dezinfekcije kože, sluzokože, usne šupljine, prižanje pomoći kod besvijesnih stanja i upoznavanje sa specifičnostima rada sa djecom, hroničnim bolesnicima, pacijentima sa posebnim potrebama.\r\n•	Omogućavanje potrebnog profesionalnog znanja i vještina u cilju ovladavanja   metodologijom  zdravstveno-vaspitnog rada i sprovođenja higijenskih principa i  mjera, u radu sa pacijentima i održavanju higijene prostorija, namještaja I pribora.\r\n•	Komuniciranje sa klijentima, pacijentima i saradnicima na maternjem i jednom stranom jeziku.\r\n•	Razvijanje ekološke svijesti i savjesti o poštovanju mjera zaštite na radu i njihove dosljedne primjene.\r\n•	Pripremanje za permanentno obrazovanje i cjeloživotno učenje. \r\n'),
(67, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Obavljanje poslova analize, planiranja i organizacije rada.\r\n•	Vršenje lične pripreme za posao.\r\n•	Obavljanje poslova pripreme radnog mjesta.\r\n•	Učešće u kreiranju aranžmana, izleta i specijalnih ponuda.\r\n•	Promocija turističkih aranžmana, izleta i specijalnih ponuda u agenciji.\r\n•	Priprema, kontrola i realizacija turističkih aranžmana i izleta.\r\n•	Obavljanje posredničkih poslova u agenciji.\r\n•	Prodaja i obračun aranžmana, izleta, transfera, smještaja i voznih karata.\r\n•	Korišćenje rezervacionih sistema u agencijskom poslovanju.\r\n•	Rad u skladu sa važećim standardima kvaliteta rada u agenciji.\r\n•	Prodaja i rezervacija smještaja.\r\n•	Prijem i prijava gosta.\r\n•	Pružanje dodatne informacije gostu.\r\n•	Pružanje dodatnih usluga gostu.\r\n•	Obračunavanje i naplata usluga.\r\n•	Odjava i ispraćaj gosta.\r\n•	Korišćenje hotelskog informacionog sistema.\r\n•	Vršenje nadzora rada pomoćnog osoblja na recepciji.\r\n•	Rad u skladu sa vaţećim standardima kvaliteta rada u hotelu.\r\n•	Priprema izvještaja i statistiĉkih pregleda.\r\n•	Obavljanje administrativnih poslova iz domena svoga rada.\r\n•	Primjena IKT-a u poslovanju.\r\n•	Vođenje poslovne komunikacije sa klijentima, saradnicima i poslovnim partnerima.\r\n•	Komunikacija sa gostima na engleskom i najmanje još jednom svjetskom jeziku, po izboru učenika/ca – nivo B1.\r\n•	Korišćenje stručne terminologije u turizmu i hotelijerstvu.\r\n•	Primjena pravila poslovne komunikacije i bontona.\r\n•	Primjena zdravstvenih, sanitarnih i bezbjednosnih standarda.\r\n•	Primjena mjera protivpoţarne zaštite.\r\n•	Pružanje prve pomoći.\r\n•	Racionalno korišćenje energije, materijala i vremena.\r\n•	Zaštita uže i šire okoline od negativnih uticaja materijala i radnih sredstava.\r\n'),
(68, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Osposobljavanje za planiranje, pripremanje, organizovanje i kontrolu svoga rada. \r\n•	Posjedovanje osnovnih znanja o propisima, normativima i standardima u drumskom saobraćaju. \r\n•	Posjedovanje osnovnih znanja o osiguranju transportnih sredstava u domaćem i međunarodnom saobraćaju. \r\n•	Posjedovanje znanja i vještina za pravilno i bezbjedno upravljanje motornim vozilom u svim vremenskim uslovima i saobraćajnim situacijama. \r\n•	Poznavanje tehnologije transportnog procesa i dokumentacije vezane uz njega. - Poznavanje vrsta i karakteristika vozila u drumskom saobraćaju.\r\n•	Poznavanje vrsta i karakteristika mehanizacije koja se koristi za utovar i istovar tereta. - Posjedovanje znanja i vještina za pravilno održavanje vozila, uređaja i opreme.\r\n•	Shvatanje značaja bezbjednosti saobraćaja na putevima.\r\n•	Osposobljavanje za sprovođenje propisanih postupaka pri saobraćajnoj nezgodi ili oštećenju tereta. \r\n•	Osposobljavanje za popunjavanje potrebne dokumentacije. \r\n•	Osposobljavanje za prevoženje tereta ili putnika od mjesta utovara (ulaska putnika) do mjesta istovara (izlaska putnika).\r\n•	Osposobljavanje za održavanje kontakata sa kontrolnim osobljem, komitentima, saobraćajnom policijom, organima MUPa i carine.\r\n•	Posjedovanje sistematičnosti i odgovornosti u radu.\r\n•	Poznavanje jedanog stranog jezika .\r\n•	Posjedovanje osnovne informatičke pismenosti.\r\n•	Osposobljavanje za racionalno korišćenje sredstva za rad, materijala, energije I vremena.\r\n•	Osposobljavanje za primjenu propisa zaštite na radu i zaštite okoline.\r\n'),
(69, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Sticanje stručno-teorijskih i praktičnih znanja iz područja drumskog saobraćaja.\r\n•	Osposobljavanje za organizaciju rada transportnog preduzeća.\r\n•	Razvijanje sposobnosti za obavljanje uviđaja saobraćajne nezgode i procjenu štete.\r\n•	Razvijanje i promovisanje odgovornosti za primjenu mjera bezbjednosti u saobraćaju.\r\n•	Osposobljavanje za dijagnosticiranje rada motora i otkaza uređaja.\r\n•	Učešće u organizaciji i planiranju poslova na održavanju vozila.\r\n•	Osposobljavanje za rad na tehničkom pregledu vozila.\r\n•	Osposobljavanje za rad na poslovima osiguranja u drumskom saobraćaju.\r\n•	Usvajanje osnovnih znanja o savremenim tehničkim rješenjima na motornim vozilima i principima njihovog funkcionisanja.\r\n•	Poznavanje savremenih tehnologija transporta u svim vidovima saobraćaja.\r\n•	Osposobljavanje za učešće u radu špediterskih organizacija.\r\n•	Poznavanje marketinga u saobraćaju.\r\n•	Osposobljavanje za rad u Rent-a-car agenciji.\r\n•	Sticanje znanja o mjerama i načinima regulisanja saobraćaja.\r\n•	Sticanje znanja o ulozi i značaju sadržaja auto baze u drumskom transportu.\r\n•	Razvijanje sposobnosti za organizaciju rada sa sredstvima unutrašnjeg transporta.\r\n•	Osposobljavanje za upravljanje vozilom.\r\n•	Sticanje znanja o izgradnji i eksploataciji puteva.\r\n•	Poznavanje karakteristika robe i načina transporta robe.\r\n•	Produbljivanje i proširivanje opšteg obrazovanja u funkciji struke.\r\n•	Osposobljavanje za kritičko vrednovanje i odgovorno djelovanje na random mjestu.\r\n•	Razvijanje osjećaja preciznosti i odgovornosti u radu.\r\n•	Ovladavanje stručnom terminologijom, neophodnom za komuniciranje sa saradnicima na poslu i korisnicima usluga.\r\n•	Poznavanje sistema vozila.\r\n•	Osposobljavanje za korišćenje tehničke dokumentacije.\r\n•	Razvijanje tehnničke kulture.\r\n•	Razvijanje saobraćajne kulture.\r\n•	Pripremanje za dalje školovanje i doživotno učenje.\r\n•	Razvijanje sposobnosti socijalne komunikacije i uspostavljanja kvalitetnih međuljudskih odnosa.\r\n•	Razvijanje osjećaja za racionalno trošenje vremena, materijala i energije.\r\n•	Razvijanje ekološke svijesti.\r\n'),
(70, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Osposobljavanje za planiranje, pripremanje, organizovanje i kontrola svoga rada i rada grupe.\r\n•	Posjedovanje osnovnih znanja o propisima, normativima i standardima u željeznici.\r\n•	Poznavanje svih dopuna, izmjena, ispravki, tumačenja i obavještenja u propisima.\r\n•	Osposobljavanje za analizu kompletne saobraćajne situacije u stanici i na pruzi.\r\n•	Osposobljavanje za kontrolisanje pravilnog sastava vozova.\r\n•	Osposobljavanje za uvođenje i otkazivanje vozova u saobraćaju.\r\n•	Osposobljavanje za pripremanje dokumentacije za saobraćaj voza.\r\n•	Osposobljavanje za praćenje hoda vozova kao i njihov prijem i otpremu iz stanice.\r\n•	Osposobljavanje formiranje puta vožnje vozova.\r\n•	Osposobljavanje za naručivanje i otkazivanje vučnih i manevarskih vozila prema planiranju otpreme vozova.\r\n•	Osposobljavanje za objavljivanje promjene u saobraćaju vozova za korisnike usluga.\r\n•	Osposobljavanje za pregledanje skretnica.\r\n•	Osposobljavanje za vođenje brige o bezbjednosti saobraćaja i primjeni propisa kod prijema i  otpreme putnika i stvari.\r\n•	Posjedovanje sistematičnosti i odgovornosti u radu.\r\n•	Poznavanje jedanog stranog jezika.\r\n•	Posjedovanje informatičke pismenosti.\r\n•	Racionalno korišćenje sredstva za rad, materijala, energije i vremena.\r\n•	Primjena propisa zaštite na radu i zaštite okoline.\r\n'),
(71, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Osposobljavanje za planiranje, pripremanje, organizovanje i kontrola svoga rada I rada grupe.\r\n•	Posjedovanje osnovnih znanja o propisima, normativima i standardima u željeznici.\r\n•	Poznavanje svih dopuna, izmjena, ispravki, tumačenja i obavještenja u propisima.\r\n•	Osposobljavanje za vršenje dnevnog pregleda radi provjere pouzdanosti i funkcionisanja vučnog vozila.\r\n•	Osposobljavanje za vožnju vučnog vozila od jedinice vuče do stanice za vuču voza.\r\n•	Osposobljavanje za vođenje brige o kvačenju vučnog vozila za voz.\r\n•	Osposobljavanje za provjeravanje ispravnosti kočnica.\r\n•	Osposobljavanje za upravljanje vučnim vozilom.\r\n•	Osposobljavanje za održavanje parametara predviđenih u knjižici reda vožnje I knjigama  saopštenja pri vožnji voza.\r\n•	Usvajanje osnovnih znanja o tehnološkim postupcima ručne i mašinske obrade I izrade dijelova.\r\n•	Osposobljavanje za vođenje brige o otkvačivanju vučnog vozila i smještanje istogna kolosijek.\r\n•	Osposobljavanje za pregledanje vozila, osiguravanje od samopokretanja, zaključavanje I predaja    ključeva otpravniku vozova.\r\n•	Osposobljavanje za upisivanje primijećenih neispravnosti.\r\n•	Osposobljavanje za preuzimanje vučnog vozila.\r\n•	Osposobljavanje za pregledanje preuzetog vučnog vozila.\r\n•	Osposobljavanje za vršenje probe ispravnosti kočnica kočnih uređaja na vozu.\r\n•	Upravljanje vučnim vozilom pri vožnji voza.\r\n•	Osposobljavanje za raspremanje vučnog vozila.\r\n•	Posjedovanje sistematičnosti i odgovornosti u radu.\r\n•	Poznavanje jedanog stranog jezika.\r\n•	Posjedovanje informatičke pismenosti.\r\n•	Osposobljavanje za racionalno korišćenje sredstava za rad, materijala, energije i vremena.\r\n•	Primjena propisa zaštite na radu i zaštite okoline.\r\n');
INSERT INTO `ciljevi` (`ID`, `naziv`) VALUES
(72, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Osposobljavanje za pripremu tehničke i druge dokumentacije potrebne za proces dobijanja metalnih legura. \r\n•	Priprema i organizovanje pojedinih faza proizvodnje i obrade željeza, čelika, obojenih metala i legura metala. \r\n•	Osposobljavanje za obavljanje laboratorijskih ispitivanja mineralnih sirovina. \r\n•	Osposobljavanje za korišćenje  metode livenja, termičke obrade, izrade kalupa i jezgara potrebnih za preradu metala.\r\n'),
(73, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Proširivanje opšteg obrazovanja u funkciji struke. \r\n•	Obezbijeđivanje stručno-teorijskih i praktičnih znanja, neophodnih za kvalitetan rad u zanimanju. \r\n•	Priprema za permanentno obrazovanje i cjeloživotno učenje. \r\n•	Razvijanje sposobnosti socijalne komunikacije i spremnost za razvijanje međuljudskih odnosa.\r\n•	Osposobljavanje za čitanje tehničkih crteža i tehnološke dokumentacije.\r\n•	Osposobljavanje za planiranje, pripremu, izvođenje, kontrolu i vrednovanje rada u zanimanju. \r\n•	Posjeduju znanja iz informatike i računske obrade podataka.\r\n•	Poznavanje osnova proizvodnje i prerade plemenitih metala, njihova svojstva i ponašanje pri obradi i završnoj doradi. \r\n•	Posjeduju znanja o vrstama i svojstvima materijala koji se koriste pri obradi plemenitih metala (boraks, kiseline, prah za lemljenje....\r\n•	Rukovanje i održavanje mašina i alata za obradu plemenitih metala.\r\n•	Poznavanje prirodnog i vještačkog dragog kamenja.\r\n•	Razvijanje ekološke svijesti i upoznavanje sa propisima zaštite i njihove primjene pri radu.\r\n'),
(74, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Mjeri i prati zagađenje životne sredine. \r\n•	Uzorkuje vazduh, vodu i zemljište za laboratorijsku analizu. \r\n•	Učestvovanje u poslovima pripreme uzoraka za analizu. \r\n•	Učestvovanje u  postupcima  fizičko-hemijskih i mikrobioloških ispitivanja uzoraka vazduha, vode i zemljišta. \r\n•	Sprovođenje preventivnih i zaštitnih mjera za očuvanje životne sredine i metode za pravilno odlaganje, skladištenje i reciklažu otpadnih materija. \r\n•	Učestvovanje u nadziranju zaštićenih područja. \r\n•	Primjenjuje propise iz oblasti zaštite životne sredine.\r\n'),
(75, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Posjeduje informatičku pismenost u izradi crteža, projekata i dokumentacije.\r\n•	Upotrebljavanje mjernih instrumenata u štamparstvu.\r\n•	Podešavanje formata štampe. \r\n•	Vrši optičko miješanje boja.\r\n•	Koristi karte, atlase i zbirke boja. \r\n•	Mjeri boje na denzitometru. \r\n•	Upravljanje štamparskim mašinama kao i pomoćnim uređajima, u najzastupljenijim štamparskim tehnikama.\r\n'),
(76, '•	Sticanje potrebnih znanja, vještina, sposobnosti i navika, zasnovanih na dostignućima nauke, tehnike, kulture i umjetnosti, a posebno u oblasti izučavanja jezika, radi nastavljanja školovanja.\r\n•	Postizanje medjunarodno uporedivog nivoa znanja.\r\n•	Razvijanje kritičkog mišljenja i prosudjivanja.\r\n•	Razvijanje sposobnosti komunikacije i nenasilnog rješavanja konflikta.\r\n•	Razvijanje odgovornog odnosa prema radnoj i životnoj sredini i sopstvenom zdravlju.\r\n•	Razvijanje solidarnosti,sposobnosti za život u pluralističkom i demokratskom društvu.\r\n•	Podsticanje razumijevanja, tolerancije i solidarnosti\r\n\r\n'),
