(81, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Obavljanje poslova analize, planiranja i organizacije rada.\r\n•	Vršenje lične pripreme za posao.\r\n•	Obavljanje poslova pripreme radnog mjesta.\r\n•	Učešće u kreiranju aranžmana, izleta i specijalnih ponuda.\r\n•	Promocija turističkih aranžmana, izleta i specijalnih ponuda u agenciji.\r\n•	Priprema, kontrola i realizacija turističkih aranžmana i izleta.\r\n•	Obavljanje posredničkih poslova u agenciji.\r\n•	Prodaja i obračun aranžmana, izleta, transfera, smještaja i voznih karata.\r\n•	Korišćenje rezervacionih sistema u agencijskom poslovanju.\r\n•	Rad u skladu sa važećim standardima kvaliteta rada u agenciji.\r\n•	Prodaja i rezervacija smještaja.\r\n•	Prijem i prijava gosta.\r\n•	Pružanje dodatne informacije gostu.\r\n•	Pružanje dodatnih usluga gostu.\r\n•	Obračunavanje i naplata usluga.\r\n•	Odjava i ispraćaj gosta.\r\n•	Korišćenje hotelskog informacionog sistema.\r\n•	Vršenje nadzora rada pomoćnog osoblja na recepciji.\r\n•	Rad u skladu sa vaţećim standardima kvaliteta rada u hotelu.\r\n•	Priprema izvještaja i statistiĉkih pregleda.\r\n•	Obavljanje administrativnih poslova iz domena svoga rada.\r\n•	Primjena IKT-a u poslovanju.\r\n•	Vođenje poslovne komunikacije sa klijentima, saradnicima i poslovnim partnerima.\r\n•	Komunikacija sa gostima na engleskom i najmanje još jednom svjetskom jeziku, po izboru učenika/ca – nivo B1.\r\n•	Korišćenje stručne terminologije u turizmu i hotelijerstvu.\r\n•	Primjena pravila poslovne komunikacije i bontona.\r\n•	Primjena zdravstvenih, sanitarnih i bezbjednosnih standarda.\r\n•	Primjena mjera protivpoţarne zaštite.\r\n•	Pružanje prve pomoći.\r\n•	Racionalno korišćenje energije, materijala i vremena.\r\n•	Zaštita uže i šire okoline od negativnih uticaja materijala i radnih sredstava.\r\n'),
(82, 'Ciljevi i zadaci obrazovnog programa su:\r\n•	Omogućuvanje svestranog razvoja pojedinca i njegove socijalne integracije.\r\n•	Produbljivanje i proširivanje opšteg obrazovanje u funkciji struke.\r\n•	Obezbijeđivanje stručno-teorijskih i praktičnih znanja, neophodnih za kvalitetan rad u zanimanju.\r\n•	Pripremanje učenika za permanentno obrazovanje i cjeloživotno učenje.\r\n•	Razvijanje sposobnosti socijalne komunikacije i spremnosti za razvijanje kvalitetnih međuljudskih odnosa. \r\n•	Osposobljavanje učenika za čitanje tehničkih crteža i tehnološke dokumentacije,\r\n•	Osposobljavanje učenika za postavljanje standardnih dijagnoza o stanju vozila, uz upotrebu odgovarajućih alata, uređaja i instrumenata.\r\n•	Osposobljavanje učenika da ugrađuju, održavaju i popravljaju mehaničke sisteme, uređaje i njihove sklopove.\r\n•	Osposobljavanje učenika da ugrađuju, održavaju i popravljaju elektronske i električne sisteme, uređaje i sklopove.\r\n•	Osposobljavanje učenika da ugrađuju, održavaju i popravljaju pneumatske i hidraulične sisteme, uređaje i njihove sklopove.\r\n•	Osposobljavanje učenika da opremaju motorno vozilo sa dodatnom opremom I priborom.\r\n•	Osposobljavanje učenika da savjetuju stranke u vezi sa popravkama i održavanjem dijelova na vozilu.\r\n•	Osposobljavanje učenika da ispunjavaju potrebnu radnu dokumentaciju i dokumenta o evidenciji stanja alata, instrumenata i uređaja, uz upotrebu računara.\r\n•	Razvijanje kod učenika ekološke svijesti i upoznavanje sa propisima o zaštiti na radu i zaštiti okoline i važnosti njihovog dosljednog poštovanja.\r\n'),
(83, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Obavi poslove platnog prometa i evidentiranja bezgotovinskog i gotovinskog (blagajničkog) plaćanja\r\n•	Obavi knjigovodstvene poslove analitike kupaca i dobavljača\r\n•	Vodi robno i materijalno knjigovodstvo i evidencije na pozicijama -kontima uspjeha (rashodi, prihodi i finansijski rezultat)\r\n•	Vodi evidencije obrtnih sredstava u propisanom knjigovodstvu, gotovine, gotovinskih ekvivalenata i hartija od vrijednosti\r\n•	Vodi evidencije poreza na dodatu vrijednost, poreza na dobit i poreza po odbitku\r\n•	Vodi knjigovodstvo stalne i nematerijalne imovine\r\n•	Vodi evidenciju kapitala, rezervi i neraspoređene dobiti, troškova materijala, troškova zarada, amortizacije, nematerijalnih troškova, troškova proizvodnih usluga, finansijskih i ostalih rashoda, poslovnih, finansijskih i ostalih prihoda\r\n•	Vodi evidencije proizvodnje, obračun troškova i učinaka\r\n•	Vodi evidencije poslovanja trgovinskog poslovnog subjekta u unutrašnjem i spoljnotrgovinskom prometu\r\n•	Vodi knjigovodstvo budžetskih korisnika, banaka, osiguravajućih organizacija i neprofitnih organizacija\r\n•	Obavlja poslove kreditiranja i kontrole kreditnih zahtjeva, u skladu sa propisanom procedurom\r\n•	Sprovede postupak otvaranja transakcionih računa za izvršavanje nacionalnih i međunarodnih platnih transakcija, u skladu sa važećim propisima i procedurama\r\n•	Obavi poslove sa depozitima fizičkih i pravnih lica, u skladu sa važećim propisima\r\n•	Obavi poslove sa gotovinom, u skladu sa djelokrugom svog rada\r\n•	Obavi poslove nacionalnog i međunarodnog platnog prometa, u skladu sa važećim propisima\r\n•	Obavi poslove bezgotovinskog plaćanja, u skladu sa važećim propisima\r\n•	Obavi osnovne finansijske poslove za poslovnog subjekta\r\n•	Upravlja budžetskim procesom poslovnog subjekta\r\n•	Upravlja finansijskim rizicima u poslovanju poslovnog subjekta\r\n•	Upravlja gotovim novcem u cilju obezbjeđenja normalnog funkcionisanja poslovnog subjekta\r\n•	Posluje sa hartijama od vrijednosti u cilju ostvarivanja prihoda poslovnog subjekta\r\n•	Sprovede postupak osiguranja lica prilikom putovanja i privremenog boravka u inostranstvu, u skladu sa propisanim uslovima i tarifama za osiguranje\r\n•	Sprovede postupak osiguranja lica od posljedica nesrećnog slučaja, u skladu sa propisanim uslovima i tarifama za osiguranje\r\n•	Sprovede postupak osiguranja motornih vozila, u skladu sa kategorijom vozila i propisanim pravilima za utvrđivanje vrijednosti vozila\r\n•	Sprovede postupak osiguranja imovine fizičkih i pravnih lica\r\n•	Sprovede postupak osiguranja transporta (CMR i KARGO) u domaćem i međunarodnom prevozu\r\n•	Sprovede postupak obrade zahtjeva i dokumentacije za naknadu štete, likvidacije i isplate štete\r\n•	Komunicira sa kolegama, strankama i drugim licima na maternjem, odnosno službenom i stranom jeziku, u skladu sa pravilima poslovne komunikacije\r\n•	Vodi administrativne i komercijalne poslove iz djelokruga svog rada\r\n•	Koristi informacione i telekomunikacione tehnologije u radu\r\n•	Primijeni postupke i mjere zaštite na radu, zdravlja i radne i životne sredine, u skladu sa propisima\r\n'),
(84, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Planira i organizuje sopstveni rad i rad pomoćnih frizera za pružanje frizerskih usluga\r\n•	Njeguje kosu, vlasište, bradu, brkove i kožu lica korisniku usluga\r\n•	Šiša kosu korisniku usluga različitim tehnikama\r\n•	Izradi namjenske muške i ženske frizure, koristeći različite tehnike\r\n•	Izvrši brijanje i oblikovanje brade i brkova i brijanje glave različitim tehnikama\r\n•	Izvrši specijalno bojenje kose, brade i brkova korisniku usluga različitim tehnikama\r\n•	Izvrši završne radove u salonu\r\n•	Izvrši nabavku, prezentaciju i prodaju alata, pribora i materijala\r\n•	Komunicira sa korisnicima usluga, poslovnim partnerima i saradnicima, koristeći pravila poslovne komunikacije i poslovnog bontona\r\n•	Sprovede postupke i mjere zaštite i zdravlja na radu, i zaštite okoline'),
(85, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Planira i organizuje poslove u kuhinjskom bloku\r\n•	Obavi pripremne poslove u kuhinjskom bloku\r\n•	Obradi namirnice prema radnom nalogu za pripremanje jednostavnih gastronomskih proizvoda\r\n•	Pripremi salate od povrća, zaprške, jednostavna jela od jaja, garniture od povrća i topla jela od jaja, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Pripremi fondove i sosove tople i hladne kuhinje, bistre supe i uloške za bistre supe, čorbe, potaže i jela od riba, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Pripremi jela sa roštilja od mljevenog mesa, od porcionisanog mesa, od iznutrica, od riba i morskih plodova i prateće dodatke, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Pripremi gastronomske proizvode od kisjelog, lisnatog, vučenog, krompir i linzer tijesta, pice, tortilje i burita i prateće nadjeve, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Pripremi povezane salate, hladna predjela od jaja, povrća, mesa, riba, rakova, mekušaca, zakuske, kanapee, bruskete, topla predjela od tijesta, krokete, pečurke, rižota, suflee i pudinge kao topla predjela, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Pripremi gotova jela, pečenja, jednostavna jela po porudžbini od mesa stoke za klanje i jednostavna nacionalna jela iz Crne gore, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Pripremi jednostavne poslastičarske proizvode od biskvit mase, od tijesta, hladne, tople, sitne kolače i jednostavne nacionalne poslastičarske proizvode iz Crne Gore, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Obavi rasijecanje, obradu, začinjavanje, formiranje, porcionisanje i pakovanje mesa, riba i morskih plodova, za gastronomsku upotrebu, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Servira i izdaje jednostavne gastronomske proizvode, u skladu sa standardima i normativima u ugostiteljstvu\r\n•	Obavi završne poslove u kuhinjskom bloku\r\n•	Vodi odgovarajuću poslovnu dokumentaciju u odgovarajućoj formi\r\n•	Rukovodi radom pomoćnog osoblja u kuhinjskom bloku\r\n•	Obavi poslove, u skladu sa normativima i standardima struke, osigurava kvalitet sopstvenog rada i pomoćnog osoblja\r\n•	Održava funkcionalnost uređaja, opreme i inventara, u skladu sa odgovarajućom procedurom i uputstvom\r\n•	Komunicira sa saradnicima i gostima koristeći pravila poslovne komunikacije\r\n•	Sprovodi postupke i mjere za ličnu zaštitu zdravlja na radu i zaštitu zdravlja gostiju i saradnika\r\n•	Primijeni standarde zaštite radne i životne sredine\r\n'),
(86, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Organizuje svoj rad i rad pomoćnog osoblja u ofisu, na reonu u sali za usluživanje i baru\r\n•	Obavi pripremne radove u ofisu, sali za usluživanje i baru\r\n•	Pripremi barski pult za točenje, miješanje i izdavanje pića, mješavina, napitaka i malih obroka\r\n•	Primi i isprati goste\r\n•	Primi porudžbinu za hranu, piće i napitke od konobara ili direktno od gosta\r\n•	Posluži hranu i piće gostima\r\n•	Natoči, aranžira i servira alkoholna, bezalkoholna pića i napitke\r\n•	Pripremi, aranžira i servira alkoholne i bezalkoholne mješavine\r\n•	Izda račun i izvrši naplatu usluga\r\n•	Izvede završne radove u ofisu, sali za usluživanje i baru\r\n•	Materijalno se zaduži i razduži\r\n•	Vodi odgovarajuću poslovnu dokumentaciju\r\n•	Rukovodi radom pomoćnog osoblja u restoranu i baru\r\n•	Obavi poslove, u skladu sa normativima i standardima struke i osigura kvalitet rada pomoćnog osoblja\r\n•	Održi funkcionalnost opreme i inventara u ofisu, sali za usluživanje i baru\r\n•	Komunicira sa saradnicima i gostima\r\n•	Štiti svoje zdravlje i zdravlje gostiju i saradnika\r\n•	Primijeni standarde zaštite radne i životne sredine\r\n'),
(87, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n•	Analizira, planira i organizuje sopstveni rad i rad pomoćnog prodavača pri obavljanju poslova prodaje robe\r\n•	Izvrši ličnu i pripremu potrebnih resursa i radnog mjesta za obavljanje posla\r\n•	Preuzme i pripremi robu za prodaju\r\n•	Izloži robu u prodajnom prostoru\r\n•	Usluži kupca, u skladu sa tipom i karakteristikama kupca i različitim načinima i vrstama prodajeIzda i naplati račun za kupljenu robu\r\n•	Izvrši pripremu za popis i otpis u prodajnom objektu\r\n•	Vodi poslovnu dokumentaciju, u skladu sa standardima struke\r\n•	Obavi poslove, u skladu sa standardima struke\r\n•	Izvrši osnovno održavanje uređaja i opreme za prodaju robe\r\n•	Komunicira sa kupcima, nadređenima i saradnicima, u skladu sa pravilima poslovne komunikacije\r\n•	Sprovede mjere zaštite i zdravlja na radu, i zaštite životne sredine'),
(88, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n• Analizira radni zadatak, planira i organizuje sopstveni rad i rad\r\nsaradnika za realizaciju poslova ispitivanja ispravnosti, popravke i\r\nodržavanja putničkih automobila i privrednih vozila\r\n• Obezbijedi resurse i pripremi radno mjesto za realizaciju poslova\r\nispitivanja ispravnosti, popravke i održavanja putničkih automobila i\r\nprivrednih vozila\r\n• Izvrši dijagnostiku i identifikuje kvarove mehatroničkih sistema na\r\nputničkim automobilima i privrednim vozilima\r\n• Izvrši preventivno i korektivno održavanje mehatroničkih sistema na\r\nputničkim automobilima i privrednim vozilima\r\n• Izvrši ispitivanje funkcionalnosti mehatroničkih sistema na putničkim\r\nautomobilima i privrednim vozilima, nakon završene popravke\r\n• Ugradi sisteme bezbjednosti i komfora na putničkim automobilima i\r\nprivrednim vozilima\r\n• Održava putničke automobile sa alternativnim pogonima\r\n• Izvrši tehnički pregled puntičkih automobila i privednih vozila\r\n• Izvrši procjenu troškova i nabavku materijala, alata, opreme i uređaja\r\npotrebnih za realizaciju radnog zadatka\r\n• Koristi stručnu terminologiju i tehničku dokumentaciju na engleskom\r\njeziku\r\n• Izradi radnu dokumentaciju prema propisanoj proceduri\r\n• Rukovodi radom i izvrši nadzor nad poslovima izvršilaca radnog\r\nzadatka\r\n• Sprovede postupke za kontrolu kvaliteta rada, u skladu sa\r\n\r\nnormativima i drugim propisima\r\n• Održava alat, opremu i uređaje za rad\r\n• Komunicira sa nadređenima, saradnicima i korisnicima usluga\r\nkoristeći pravila poslovne komunikacije\r\n• Sprovede postupke i mjere za zaštitu na radu, zaštitu okoline i\r\nočuvanje zdravlja'),
(89, 'Po završetku obrazovnog programa učenik će biti sposoban da:\r\n• Planira realizaciju i organizuje sopstveni rad i rad pomoćnika za\r\nizvođenje poslova ispitivanja ispravnosti, popravke i održavanja\r\nmehaničkih sistema na motornim vozilima\r\n• Pripremi resurse i radno mjesto za izvođenje poslova ispitivanja\r\nispravnosti, popravke i održavanja mehaničkih sistema na motornim\r\nvozilima\r\n• Izvrši vulkanizerske poslove održavanja pneumatika i naplataka na\r\nmotornim vozilima\r\n• Izvrši poslove čišćenja, pranja i podmazivanja motornih vozila  Utvrdi\r\npostojanje kvarova na mehaničkim sistemima motornih vozila\r\n• Izvrši preventivno i korektivno održavanje mehaničkih sistema na\r\nmotornim vozilima\r\n• Izvrši ispitivanje funkcionalnosti mehaničkih sistema na motornim\r\nvozilima, nakon završene popravke\r\n• Učestvuje u nabavci materijala, alata, opreme i uređaja potrebnih za\r\nrealizaciju radnog zadatka\r\n• Izradi radnu dokumentaciju prema propisanoj proceduri\r\n\r\n• Izvrši nadzor nad poslovima pomoćnika tokom realizacije radnog\r\nzadatka\r\n• Sprovede postupke za kontrolu kvaliteta rada, u skladu sa\r\nnormativima i drugim propisima\r\n• Održava alat, opremu i uređaje za rad\r\n• Komunicira sa nadređenima, saradnicima i korisnicima usluga\r\nkoristeći pravila poslovne komunikacije\r\n• Sprovede postupke i mjere za zaštitu na radu, zaštitu okoline i\r\nočuvanje zdravlja'),
(90, 'Po završetku obrazovnog programa, učenik će biti sposoban da:\r\n• 	Planira realizaciju i organizuje sopstveni rad i rad pomoćnika za izvođenje poslova ispitivanja ispravnosti, popravke i podešavanja električnih i elektronskih uređaja i sistema na motornim vozilima \r\n• 	Pripremi resurse i radno mjesto za izvođenje poslova ispitivanja ispravnosti, popravke i podešavanja električnih i elektronskih uređaja i sistema na motornim vozilima\r\n• 	Utvrdi postojanje kvarova na električnim i elektronskim sistemima motornih vozila\r\n• 	Izvrši otklanjanje kvarova na električnim i elektronskim sistemima motornih vozila\r\n• 	Izvrši ispitivanje funkcionalnosti električnih i elektronskih sistema na motornim vozilima, nakon završene popravke\r\n• 	Učestvuje u nabavci materijala, alata, opreme i uređaja potrebnih za realizaciju radnog zadatka\r\n• 	Izradi radnu dokumentaciju prema propisanoj proceduri\r\n• 	Izvrši nadzor nad poslovima pomoćnika tokom realizacije radnog zadatka\r\n• 	Sprovede postupke za kontrolu kvaliteta rada, u skladu sa normativima i drugim propisima\r\n• 	Održava alat, opremu i uređaje za rad\r\n• 	Komunicira sa nadređenima, saradnicima i korisnicima usluga koristeći pravila poslovne komunikacije \r\n• 	Sprovede postupke i mjere za zaštitu na radu, zaštitu okoline i očuvanje zdravlja\r\n'),
(91, 'Po završetku obrazovnog programa, učenik će biti sposoban da:\r\n• 	Analizira radni zadatak, planira realizaciju i organizuje sopstveni rad i rad grupe za izvođenje poslova arhitektonskog projektovanja i izvođenja objekata visokogradnje\r\n• 	Obezbijedi resurse i pripremi radno mjesto za izvođenje poslova arhitektonskog projektovanja i izvođenja objekata visokogradnje\r\n• 	Izvrši pripremne poslove za izradu tehničke dokumentacije predmetnog projekta, u skladu sa projektnim zadatkom\r\n• 	Izradi djelove idejnog i glavnog projekta arhitekture i dizajna enterijera, u koordinaciji sa odgovornim projektantom \r\n• 	Izradi djelove projekta arhitekture izvedenog objekta, u koordinaciji sa odgovornim projektantom\r\n• 	Analizira podatke postojećeg stanja zahvata planskog dokumenata, u koordinaciji sa odgovornim planerom\r\n• 	Izradi grafičke i tekstualne djelove planskog dokumenata, u koordinaciji sa odgovornim planerom\r\n• 	Kompletira predloge planske dokumentacije, u koordinaciji sa odgovornim planerom \r\n• 	Izradi trodimenzionalni prikaz projekta, u koordinaciji sa odgovornim \r\n• 	projektantom\r\n• 	Kompletira tehničku dokumentaciju, u koordinaciji sa odgovornim projektantom\r\n• 	Izvrši procjenu vrijednosti nekretnine, pod nadzorom ovlašćenog procjenitelja \r\n• 	Organizuje gradilište i izvođenje radova na gradilištu, u koordinaciji sa odgovornim inženjerom\r\n• 	Obezbijedi građevinske materijale, alat, opremu i mehanizaciju, u koordinaciji sa odgovorinim inženjerom\r\n• 	Izvrši kontrolu kvaliteta materijala, opreme i izvođenja radova\r\n• 	Koristi stručnu terminologiju i tehničku dokumentaciju na engleskom jeziku \r\n• 	Izvrši procjenu troškova i nabavku materijala, opreme, uređaja i rezervnih djelova potrebnih za realizaciju radnog zadatka\r\n• 	Izradi radnu dokumentaciju prema propisanoj proceduri \r\n• 	Rukovodi radnom grupom za realizaciju radnog zadatka i izvrši nadzor nad poslovima koje grupa izvodi \r\n• 	Sprovede postupke za kontrolu kvaliteta rada, u skladu sa normativima i drugim propisima\r\n• 	Kontroliše ispravnost i funkcionalnost pribora za crtanje i softverskih paketa\r\n• 	Održava alat, opremu i uređaje koje koristi za rad \r\n• 	Komunicira sa nadređenima, saradnicima i korisnicima usluga \r\n'),
(92, 'Po završetku obrazovnog programa, učenik će biti sposoban da:\r\n• 	Analizira radni zadatak, planira realizaciju i organizuje sopstveni rad i rad grupe za izvođenje poslova arhitektonskog projektovanja i izvođenja objekata visokogradnje\r\n• 	Obezbijedi resurse i pripremi radno mjesto za izvođenje poslova arhitektonskog projektovanja i izvođenja objekata visokogradnje\r\n• 	Izvrši pripremne poslove za izradu tehničke dokumentacije predmetnog projekta, u skladu sa projektnim zadatkom\r\n• 	Izradi djelove idejnog i glavnog projekta arhitekture i dizajna enterijera, u koordinaciji sa odgovornim projektantom \r\n• 	Izradi djelove projekta arhitekture izvedenog objekta, u koordinaciji sa odgovornim projektantom\r\n• 	Analizira podatke postojećeg stanja zahvata planskog dokumenata, u koordinaciji sa odgovornim planerom\r\n• 	Izradi grafičke i tekstualne djelove planskog dokumenata, u koordinaciji sa odgovornim planerom\r\n• 	Kompletira predloge planske dokumentacije, u koordinaciji sa odgovornim planerom \r\n• 	Izradi trodimenzionalni prikaz projekta, u koordinaciji sa odgovornim \r\n• 	projektantom\r\n• 	Kompletira tehničku dokumentaciju, u koordinaciji sa odgovornim projektantom\r\n• 	Izvrši procjenu vrijednosti nekretnine, pod nadzorom ovlašćenog procjenitelja \r\n• 	Organizuje gradilište i izvođenje radova na gradilištu, u koordinaciji sa odgovornim inženjerom\r\n• 	Obezbijedi građevinske materijale, alat, opremu i mehanizaciju, u koordinaciji sa odgovorinim inženjerom\r\n• 	Izvrši kontrolu kvaliteta materijala, opreme i izvođenja radova\r\n• 	Koristi stručnu terminologiju i tehničku dokumentaciju na engleskom jeziku \r\n• 	Izvrši procjenu troškova i nabavku materijala, opreme, uređaja i rezervnih djelova potrebnih za realizaciju radnog zadatka\r\n• 	Izradi radnu dokumentaciju prema propisanoj proceduri \r\n• 	Rukovodi radnom grupom za realizaciju radnog zadatka i izvrši nadzor nad poslovima koje grupa izvodi \r\n• 	Sprovede postupke za kontrolu kvaliteta rada, u skladu sa normativima i drugim propisima\r\n• 	Kontroliše ispravnost i funkcionalnost pribora za crtanje i softverskih paketa\r\n• 	Održava alat, opremu i uređaje koje koristi za rad \r\n• 	Komunicira sa nadređenima, saradnicima i korisnicima usluga \r\nPo završetku obrazovnog programa, učenik će biti sposoban da:\r\n• 	Analizira radni zadatak, planira realizaciju i organizuje sopstveni rad i rad grupe za izvođenje poslova dekorisanja i aranžiranja prostora\r\n• 	Obezbijedi resurse i pripremi radno mjesto za izvođenje poslova dekorisanja i aranžiranja prostora\r\n• 	Izvrši prijem klijenata u radnom prostoru, u skladu sa pravilima poslovne komunikacije i bontona\r\n• 	Izradi planove dekorisanja i aranžiranja prostora\r\n• 	Dekoriše prostor za događaje\r\n• 	Dekoriše enterijer\r\n• 	Dekoriše i aranžira izloge i postavke\r\n• 	Izradi, prezentuje i proda dekorativne predmete\r\n• 	Postavi cijene prodajne robe i reklamnih poruka izloga i postavki\r\n• 	Izvrši završne poslove u radnom prostoru\r\n• 	Izvrši nabavku opreme za izvođenje poslova dekorisanja i aranžiranja prostora\r\n• 	Ispuni i vodi radnu dokumentaciju prema propisanoj proceduri\r\n• 	Izvrši naplatu i promociju usluga dekorisanja i aranžiranja prostora\r\n• 	Koristi stručnu terminologiju i tehničku dokumentaciju na engleskom jeziku \r\n• 	Izvrši procjenu troškova i nabavku materijala, opreme, uređaja i rezervnih djelova potrebnih za realizaciju radnog zadatka\r\n• 	Izradi radnu dokumentaciju prema propisanoj proceduri \r\n• 	Rukovodi radnom grupom za realizaciju radnog zadatka i izvrši nadzor nad poslovima koje grupa izvodi \r\n• 	Sprovede postupke za kontrolu kvaliteta rada, u skladu sa normativima i drugim propisima\r\n• 	Održava alat, opremu i uređaje koje koristi za rad \r\n• 	Komunicira sa nadređenima, saradnicima i korisnicima usluga koristeći pravila poslovne komunikacije \r\n• 	Sprovede postupke i mjere za zaštitu na radu, zaštitu okoline i očuvanje zdravlja \r\n'),
(93, 'Po završetku obrazovnog programa, učenik će biti sposoban da:\r\n• 	 Analizira radni zadatak, planira realizaciju i organizuje sopstveni rad i rad grupe za izvođenje geodetskih poslova \r\n• 	Obezbijedi resurse i pripremi radno mjesto za izvođenje geodetskih poslova  \r\n• 	 Izradi geodetsku podlogu za potrebe projektovanja objekata u inženjersko-tehničkim oblastima (arhitektura, građevinarstvo, mašinstvo, elektroprivreda i rudarstvo)\r\n• 	 Izradi geodetsku mrežu za izgradnju i održavanje inženjerskih objekata \r\n• 	Izvede geodetske radove na izgradnji i održavanju inženjerskih objekata  \r\n• 	 Izradi Elaborat o izvršenim geodetskim radovima \r\n• 	Izvede geodetske poslove na osnivanju katastra nepokretnosti  •  Održava katastar nepokretnosti i adresni registar nosioca prava nepokretnosti \r\n• 	 Izvede geodetske radove u postupku eksproprijacije \r\n• 	 Održava katastar vodova i podzemnih instalacija \r\n• 	Koristi stručnu terminologiju i tehničku dokumentaciju na engleskom jeziku  \r\n• 	 Izvrši procjenu troškova i nabavku materijala, geodetske opreme i rezervnih djelova potrebnih za realizaciju radnog zadatka\r\n• 	 Izradi radnu dokumentaciju prema propisanoj proceduri  •  Rukovodi radnom grupom za realizaciju radnog zadatka i izvrši nadzor nad poslovima koje grupa izvodi \r\n• 	 Sprovede postupke za kontrolu kvaliteta rada, u skladu sa normativima i drugim propisima \r\n• 	 Održava alat i geodetsku opremu koje koristi za rad  \r\n• 	Komunicira sa nadređenima, saradnicima i korisnicima usluga koristeći pravila poslovne komunikacije  \r\n• 	Sprovede postupke i mjere za zaštitu na radu, zaštitu okoline i očuvanje zdravlja\r\n'),
(94, 'Po završetku obrazovnog programa, učenik će biti sposoban da:\r\n• 	Analizira radni zadatak u cilju pripreme za njegovu realizaciju\r\n• 	Planira i organizuje sopstveni rad i rad grupe za realizaciju poslova finalne obrade drveta \r\n• 	Obezbjeđuje uslove za obavljanje poslova, u skladu sa planiranim \r\n• 	aktivnostima i radnim zadatkom \r\n• 	Pripremi radno mjesto za realizaciju poslova finalne obrade drveta, u skladu sa planiranim aktivnostima i radnim zadatkom \r\n• 	Organizuje poslove u jedinicama za obradu drveta\r\n• 	Pripremi i reže trupce za dobijanje rezane drvene građe\r\n• 	Kroji drvenu rezanu građu i iskorišćava korisni otpad \r\n• 	Sortira, klasira i obilježava rezanu drvenu građu za lagerovanje i dalji transport \r\n• 	Obavi postupak proizvodnje furnira i furnirskih ploča za finalnu obradu drveta\r\n• 	Obavi postupak proizvodnje lameliranih konstrukcija od drveta\r\n• 	Obavi postupak proizvodnje podnih i zidnih obloga\r\n• 	Obavi postupak proizvodnje peleta i briketa\r\n• 	Obavi postupak sušenja i parenja rezane drvene građe \r\n• 	Izradi crteža konstruktivnih elemenata i gotovih proizvoda od masivnog drveta i ploča na bazi drveta\r\n• 	Obavi postupak izrade detalja od masivnog drveta\r\n• 	Obavi postupak izrade i ugradnje proizvoda od masivnog drveta \r\n• 	Obavi postupak izrade i ugradnje proizvoda od ploča na bazi drveta\r\n• 	Upravlja CNC mašinama u finalnoj obradi drveta\r\n• 	Ispita tehnička svojstva drveta i kvalitet proizvoda obrade drveta\r\n• 	Planira opremu, materijal i uređaje potrebne za realizaciju radnog zadatka\r\n• 	Izradi radnu dokumentaciju \r\n• 	Rukovodi radnom grupom za realizaciju radnog zadatka i vrši nadzor njenog rada\r\n• 	Obavi poslove u skladu sa standardima struke \r\n• 	Izvrši osnovno održavanje alata, opreme i uređaja za rad, koje koristi pri obavljanju posla \r\n• 	Komunicira sa saradnicima, nadređenima i korisnicima usluga \r\n• 	Primijeni mjere zaštite i zdravlja na radu i zaštite životne sredine \r\n'),
(95, 'Po završetku obrazovnog programa, učenik će biti sposoban da:\r\n• 	Planira i organizuje sopstveni rad za realizaciju poslova obrade drveta\r\n• 	Pripremi uslove za obavljanje poslova, u skladu sa planiranim aktivnostima i radnim zadatkom \r\n• 	Pripremi radno mjesto za realizaciju poslova obrade drveta, u skladu sa planiranim aktivnostima i radnim zadatkom \r\n• 	Pripremi i reže trupce za dobijanje rezane drvene građe\r\n• 	Kroji drvenu rezanu građu i iskorišćava korisni otpad \r\n• 	Sortira, klasira i obilježava rezanu drvenu građu za lagerovanje i dalji transport \r\n• 	Obavi postupak proizvodnje furnira i furnirskih ploča za finalnu obradu\r\n• 	Obavi postupak proizvodnje lameliranih konstrukcija od rveta\r\n• 	Obavi postupak proizvodnje podnih i zidnih obloga\r\n• 	Obavi postupak proizvodnje peleta i briketa\r\n• 	Obavi postupak sušenja i parenja rezane drvene građe \r\n• 	Izradi crteže konstruktivnih elemenata i gotovih proizvoda od masivnog drveta i pločastog materijala\r\n• 	Obavi postupak izrade detalja od masivnog drveta\r\n• 	Obavi postupak izrade i ugradnje proizvoda od masivnog drveta \r\n• 	Obavi postupak izrade i ugradnje proizvoda od ploča na bazi drveta\r\n• 	Izvrši nabavku opreme, materijala i uređaja potrebnih za realizaciju radnog zadatka\r\n• 	Popuni radnu dokumentaciju\r\n• 	Obavi poslove u skladu sa standardima struke \r\n• 	Izvrši osnovno održavanje alata, opreme i uređaja za rad, koje koristi pri obavljanju posla \r\n• 	Komunicira sa saradnicima, nadređenima i korisnicima usluga \r\n• 	Primijeni mjere zaštite i zdravlja na radu i zaštite životne sredine \r\n'),
(96, ''),
(97, 'Po završetku obrazovnog programa, učenik će biti sposoban da:\r\n-	Planira aktivnosti za izvođenje medicinsko-terapijskih masaža i hidro-peloido terapijskih procedura\r\n-	Organizuje sopstveni rad za izvođenje medicinsko-terapijskih masaža i hidro-peloido terapijskih procedura\r\n-	Pripremi resurse i radno mjesto za izvođenje medicinsko-terapijskih masaža i hidro-peloido terapijskih procedura\r\n-	Izvrši ličnu pripremu za izvođenje medicinsko-terapijskih masaža i hidro-peloido terapijskih procedura\r\n-	Izvrši pregled i analizu kože tijela pacijenta u cilju utvrđivanja mogućnosti izvođenja medicinsko-terapijskih masaža i hidro-peloido terapijskih procedura\r\n-	Pripremi pacijenta za izvođenje medicinsko-terapijskih masaža i hidro-peloido terapijskih procedura\r\n-	Izvede opštu, parcijalnu i refleksnu masažu tijela, primjenom odgovarajućih masažnih hvatova i međuhvatova\r\n-	Izvede manuelnu limfnu drenažu, u slučaju postojanja i u slučaju ne postojanja limfedema primjenom odgovarajućih pokreta i tehnika, redosljeda izvođenja, protokola i standarda\r\n-	Izvede aparaturnu masažu i aparaturnu limfnu drenažu tijela odgovarajućim aparatima, u skladu sa uputstvima proizvođača\r\n-	Primijeni terapijsku masažu kod postraumatskih stanja i različitih oboljenja\r\n-	Izvede wellness masaže tijela \r\n-	Izvede pripremnu, relaksirajuću masažu i krioterapiju kod sportista\r\n-	Sprovede hidroterapijske kupke \r\n-	Sprovede hidroterapijske tuševe u skladu sa zdravstvenim stanjem pacijanta i propisima fizioterapeuta i/ili ljekara \r\n-	Sprovede peloidoterapijske procedure u skladu sa zdravstvenim stanjem pacijenta i propisima fizioterapeuta i/ ili ljekara\r\n-	Koristi stručnu terminologiju na engleskom jeziku \r\n-	Obavi završne poslove nakon izvođenja medicinsko-terapijskih masaža i hidro-peloido terapijskih procedura\r\n-	Pruži prvu pomoć saradniku i/ili pacijentu u slučaju povrede ili da pacijentu pozli, u skladu sa procedurom\r\n-	Izvrši nabavku opreme, masažnih sredstava, pribora i materijala za rad\r\n-	Vodi medicinsku dokumentaciju u odgovarajućoj formi, prema propisanoj proceduri\r\n-	Sprovede postupke za kontrolu kvaliteta rada prilikom izvođenja fizioterapijskih procedura\r\n-	Izvrši osnovno održavanje opreme i pribora za rad za izvođenje fizioterapijskih procedura\r\n-	Komunicira sa saradnicima, poslovnim partnerima, pacijentima i klijentima, u skladu sa pravilima poslovne komunikacije\r\n-	Sprovede postupke i mjere za zaštitu na radu, zaštitu zdravlja i okoline\r\n'),
(98, 'Po završetku obrazovnog programa, učenik će biti sposoban da:\r\n-	Izvrši analizu, planiranje i organizaciju poslova u pogonu za proizvodnju konditorskih proizvoda i poslastičarnici\r\n-	Organizuje i kontroliše pripremne poslove u pogonu za proizvodnju konditorskih proizvoda i poslastičarnici\r\n-	Izvrši obradu i kontrolu obrade namirnica (sirovina) i poluproizvoda za izradu konditorskih i poslastičarskih proizvoda\r\n-	Pripremi tijesta i poluproizvode od tijesta za izradu konditorskih i poslastičarskih proizvoda\r\n-	Izradi mase, kremove i prelive za izradu konditorskih i poslastičarskih proizvoda\r\n-	Izradi konditorske proizvode od tijesta, žitarica i orašastih plodova\r\n-	Izradi konditorske proizvode na bazi kakaoa i čokolade\r\n-	Izradi šećerne, šećerno-sirupne rastvore i bombone\r\n-	Izradi poslastičarske proizvode od tijesta\r\n-	Pripremi sitne kolače, tople poslastice i nacionalne poslastičarske proizvode\r\n-	Izradi različite vrste torti\r\n-	Izradi sladolede i ledene poslastice\r\n-	Obavi i kontroliše proces pakovanja, deklarisanja i skladištenja gotovih konditorskih i poslastičarskih proizvoda, u skladu sa parocedurama i uputstvima poslodavca i važećim zakonskim propisima\r\n-	Izradi dekoracije od različitih vrsta namirnica (sirovina) za konditorske i poslastičarske proizvode\r\n-	Servira i prezentuje konditorske i poslastičarske proizvode, u skladu \r\n-	sa standardima u konditorskoj i poslastičarskoj proizvodnji\r\n-	Obavi i izvrši kontrolu završnih poslova u pogonu za proizvodnju konditorskih proizvoda i poslastičarnici\r\n-	Izračuna utrošak namirnica (sirovina), materijala i vremena za realizaciju radnih zadataka \r\n-	Vodi poslovnu dokumentaciju, u odgovarajućoj formi\r\n-	Rukovodi radom pomoćnog osoblja i nadzire njihov rad\r\n-	Sprovede postupke za kontrolu kvaliteta rada, u skladu sa procedurama i uputstvima poslodavca, važećim zakonskim propisima, standardima i normativima u konditorskoj i poslastičarskoj proizvodnji\r\n-	Izvrši osnovno održavanje funkcionalnosti uređaja, opreme i inventara \r\n-	u konditorskoj i poslastičarskoj proizvodnji, prema uputstvima proizvođača, procedurama i uputstvima poslodavca, u skladu sa važećim zakonskim propisima\r\n-	Obavi kominikaciju sa saradnicima i gostima, u skladu sa pravilima poslovne komunikacije, procedurama i uputstvima poslodavca\r\n-	Sprovede postupke i mjere za ličnu zaštitu zdravlja na radu i zaštitu zdravlja gostiju i saradnika, u skladu sa zakonima, propisima, procedurama i uputstvima poslodavca\r\n-	Primijeni standarde zaštite radne i životne sredine shodno pozitivnim zakonskim propisima, procedurama i uputstvima poslodavca\r\n'),
(99, 'Ciljevi i zadaci obrazovnog programa su:\r\n-	Produbljivanje i proširivanje opšteg obrazovanja u funkciji struke i obezbjeđivanje stručno-teorijskih i praktičnih znanja, neophodnih za samostalno obavljanje poslova, definisanih standardima zanimanja.\r\n-	Osposobljavanje za planiranje, koordinaciju i programiranje medicinske zaštite i osiguravanje prostornih i organizacionih uslova rada.\r\n-	Osposobljavanje za pripremu aparature i pribora za izradu ljekova, kao i aparaturu i pribor za ispitivanje nabavljenih droga i hemikalija.\r\n-	Osposobljavanje za vođenje poslova prijeme ljekova, droga, hemikalija i drugog u veledrogeriji.\r\n-	Razvijanje vještina i znanja za prijem, defektiranje i skladištenje ljekova, droga, ljekovitih supstanci, pomoćnih supstanci i ambalaže.\r\n-	Osposobljavanje za pripremu magistralnih ljekova i galenskih pripravaka.\r\n-	Sticanje sposobnosti izvođenje i nadzora tehnoloških faza u farmaceutskoj i kozmetičkoj proizvodnji.\r\n-	Osposobljavanje za prodaju ljekova, dijetetskih i kozmetičkih preparata, sanitetskog i drugog materijala i medicinske aparature.\r\n-	Osposobljavanje za vođenje odgovarajuće medicinske dokumentacije u svim procesima rada.\r\n-	Sticanje sposobnosti održavanja higijene pribora i aparature.\r\n-	Razvijanje svijesti o značaju prevencije zdravlja i osposobljavanje za sprovođenje zdravstveno vaspitnog rada.\r\n-	Sticanje vještina poslovne kulture, etike i komunikacije sa klijentima.\r\n-	Sticanje osnovne informatičke pismenosti i komunikacije na bar jednom stranom jeziku.\r\n-	Sticanje znanja o osnovama ekološke zaštite i principima zaštite radne okoline.\r\n-	Upoznavanje sa novim tehnologijama u zdravstvu i potrebama konstantnog usvajanja novog znanja i vještina.\r\n'),
(100, 'Po završetku obrazovnog programa, učenik će biti sposoban da:\r\n•	Obavi poslove platnog prometa i evidentiranja bezgotovinskog i gotovinskog (blagajničkog) plaćanja\r\n•	Obavi knjigovodstvene poslove analitike kupaca i dobavljača\r\n•	Vodi robno i materijalno knjigovodstvo i evidencije na pozicijama -kontima uspjeha (rashodi, prihodi i finansijski rezultat)\r\n•	Vodi evidencije obrtnih sredstava u propisanom knjigovodstvu, gotovine, gotovinskih ekvivalenata i hartija od vrijednosti\r\n•	Vodi evidencije poreza na dodatu vrijednost, poreza na dobit i poreza po odbitku\r\n•	Vodi knjigovodstvo stalne i nematerijalne imovine\r\n•	Vodi evidenciju kapitala, rezervi i neraspoređene dobiti, troškova materijala, troškova zarada, amortizacije, nematerijalnih troškova, troškova proizvodnih usluga, finansijskih i ostalih rashoda, poslovnih, finansijskih i ostalih prihoda\r\n•	Vodi evidencije proizvodnje, obračun troškova i učinaka\r\n•	Vodi evidencije poslovanja trgovinskog poslovnog subjekta u unutrašnjem i spoljnotrgovinskom prometu\r\n•	Vodi knjigovodstvo budžetskih korisnika, banaka, osiguravajućih organizacija i neprofitnih organizacija\r\n•	Obavlja poslove kreditiranja i kontrole kreditnih zahtjeva, u skladu sa propisanom procedurom\r\n•	Sprovede postupak otvaranja transakcionih računa za izvršavanje nacionalnih i međunarodnih platnih transakcija, u skladu sa važećim propisima i procedurama\r\n•	Obavi poslove sa depozitima fizičkih i pravnih lica, u skladu sa važećim propisima\r\n•	Obavi poslove sa gotovinom, u skladu sa djelokrugom svog rada\r\n•	Obavi poslove nacionalnog i međunarodnog platnog prometa, u skladu sa važećim propisima\r\n•	Obavi poslove bezgotovinskog plaćanja, u skladu sa važećim propisima\r\n•	Obavi osnovne finansijske poslove za poslovnog subjekta\r\n•	Upravlja budžetskim procesom poslovnog subjekta\r\n•	Upravlja finansijskim rizicima u poslovanju poslovnog subjekta\r\n•	Upravlja gotovim novcem u cilju obezbjeđenja normalnog funkcionisanja poslovnog subjekta\r\n•	Posluje sa hartijama od vrijednosti u cilju ostvarivanja prihoda poslovnog subjekta\r\n•	Sprovede postupak osiguranja lica prilikom putovanja i privremenog boravka u inostranstvu, u skladu sa propisanim uslovima i tarifama za osiguranje\r\n•	Sprovede postupak osiguranja lica od posljedica nesrećnog slučaja, u skladu sa propisanim uslovima i tarifama za osiguranje\r\n•	Sprovede postupak osiguranja motornih vozila, u skladu sa kategorijom vozila i propisanim pravilima za utvrđivanje vrijednosti vozila\r\n•	Sprovede postupak osiguranja imovine fizičkih i pravnih lica\r\n•	Sprovede postupak osiguranja transporta (CMR i KARGO) u domaćem i međunarodnom prevozu\r\n•	Sprovede postupak obrade zahtjeva i dokumentacije za naknadu štete, likvidacije i isplate štete\r\n•	Komunicira sa kolegama, strankama i drugim licima na maternjem, odnosno službenom i stranom jeziku, u skladu sa pravilima poslovne komunikacije\r\n•	Vodi administrativne i komercijalne poslove iz djelokruga svog rada\r\n•	Koristi informacione i telekomunikacione tehnologije u radu\r\n•	Primijeni postupke i mjere zaštite na radu, zdravlja i radne i životne sredine, u skladu sa propisima');
